(2, 'Rappelz - 1', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/rappelz_2.5.htm', 'Онлайн-игры', 0, '', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2', ' 													 - 											', '12,00%', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:47'),
(13, '11x11 - 1', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/x_13.5.htm', 'Онлайн-игры', 0, '11х11 &mdash; футбольная онлайн-игра, при регистрации в которой игрок получает команду из 18 человек, выступая в роли главного тренера.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=13', ' 													 - 											', '40,00%', '0.00', '62 860.61', 1, NULL, '2013-12-04 16:36:47'),
(14, 'Короли льда - 1', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/koroli_lda_14.5.htm', 'Онлайн-игры', 0, '', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=14', ' 													 - 											', '40,00%', '48 128.15', '5 592.58', 1, NULL, '2013-12-04 16:36:47'),
(15, 'Гладиаторы - 1', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/gladiatoryi_15.5.htm', 'Онлайн-игры', 0, 'Гладиаторы - бесплатная онлайн игра, которая окунет игрока в мир жесточайших боев Древнего Рима.&nbsp;В начале игрок получает в распоряжение свою гладиаторскую школу, в которую он должен нанять самых лучших и избранных воинов для проведения турниров, чемпионатов и соревнований. Это могут быть не только воины, но и гладиаторы разных типов: конные, колесничие, а также лучники.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=15', ' 													 - 											', '40,00%', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:47'),
(16, 'BananaWars', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bananawars_16.5.htm', 'Онлайн-игры', 0, '', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=16', ' 													 - 											', '40,00%', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:47'),
(20, 'ТехноМагия - 4', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/tehnomagiya_20.5.htm', 'Онлайн-игры', 1, '', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=20', ' 													 - 											', '36,00 - 44,00', '4 537.98', '4 442.11', 1, NULL, '2013-12-04 16:36:47'),
(78, 'Понаехали тут', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/ponaehali_tut_78.5.htm', 'Онлайн-игры', 1, '', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=78', ' 													 - 											', '320,00', '9 842.94', '4 314.28', 1, NULL, '2013-12-04 16:36:47'),
(105, 'Audition2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/audition_105.5.htm', 'Онлайн-игры', 1, 'Audition2 &ndash; это бесплатная клиентская онлайн-игра в танцевальном жанре. Для того чтобы начать играть, необходимо создать себе персонажа (мальчика или девочку) на свое усмотрение: есть возможность не только выбора национальности, лица, прически, но и одежды, аксессуаров, которые можно заменять на протяжении игры в специализированных магазинах за игровую валюту.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=105', ' 													 - 											', '16,00', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:47'),
(107, 'Кабал Онлайн', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/kabal_onlayn_107.5.htm', 'Онлайн-игры', 0, 'Cabal Online &mdash; это MMORPG онлайн игра корейских разработчиков, которая позиционируется как смесь RPG и Action и наполнена внушительным живым миром, нациями, гильдиями, квестами, а также интереснейшим сюжетом на основе противостояния Героев против Злодеев.&nbsp;', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=107', ' 													 - 											', '84,00', '4 058.62', '3 163.80', 1, NULL, '2013-12-04 16:36:47'),
(109, 'Седьмой Элемент', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/sedmoy_element_109.5.htm', 'Онлайн-игры', 0, '7 Элемент - это массовая многопользовательская MMORPG.&nbsp;По сюжету игроку предстоит принять участие в битвах против Ордена магов, который пытается освободить шесть элементов&nbsp;(Огонь, Ветер, Вода, Металл, Земля и Дерево), чуть не уничтожившие Землю Нейя. Эти элементы были запечатаны при помощи седьмого элемента - Жизни.&nbsp;На выбор предлагается персонажа среди трёх классов - Воин, Охотник или Маг, каждый из которых имеет не только свои уникальные способности и навыки,&nbsp;но и может превращаться в демоническую сущность, тем самым увеличивая и усиливая все возможности героя.&nbsp;', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=109', ' 													 - 											', '85,00', '3 866.87', '3 802.95', 1, NULL, '2013-12-04 16:36:47'),
(112, 'My Lands - 2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/my_lands_112.5.htm', 'Онлайн-игры', 1, 'My Lands - браузерная онлайн-стратегия с возможностью вывода игровых денег в реальные. Эта MMORPG не требует установки на компьютер &ndash; достаточно выйти в интернет с любого браузера и начать игру. Графика этой военно-экономической стратегии в реальном времени вдохновлена Heroes of Might and Magic, а сама игра признана &laquo;Лучшей браузерной игрой 2010 года&raquo; по мнению ConfOg. Четыре классические расы на выбор: эльфы, дроу (темные эльфы), рыцари и демоны позволяют определенные бонусы в игре, а битва 2 фракций &ndash; Темной (дроу и демоны) и Светлой (рыцари и эльфы) &ndash; делают игру интереснее.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=112', ' 													 - 											', '58,00', '2 908.14', '2 908.14', 1, NULL, '2013-12-04 16:36:47'),
(117, 'DarkOrbit', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/darkorbit_117.5.htm', 'Онлайн-игры', 1, 'DarkOrbit &mdash; это браузерная онлайн игра, действие которой происходит на просторах Вселенной.&nbsp;В начале игроку предстоит выбрать одну из трёх представленных рас со следующих планет: Марс, Венера и Земля.&nbsp;Далее следует прокачивать и совершенствовать свои космические корабли и юниты, добывать полезные минералы и&nbsp; предметы, выполнять различные квесты и задания, участвовать в аукционах и торгах и, конечно же, завоевывать вражеские&nbsp; территории, уничтожая противника своими силами, либо путем создания космических содружеств.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=117', ' 													3,45 - 11,23											', '19,86 - 59,59', '2 812.27', '3 004.01', 1, NULL, '2013-12-04 16:36:48'),
(125, 'Desert Operations', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/desert_operations_125.5.htm', 'Онлайн-игры', 1, 'Игра представляет собой браузерную стратегию в жанре MMORPG.&nbsp;За победу в первом бою вместо денежных средств игрок получает в свое распоряжение завоеванные ресурсодобывающие здания противника, тем самым имея возможность заработать на их труде.&nbsp;Стоит уточнить, что после проигрыша база врага остается не до конца разрушенной и есть возможность, что в скором времени он вернется отомстить, поэтому следует как можно чаще следить за своей территорией, развивать и укреплять ее, чтобы пресечь внезапные атаки.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=125', ' 													5,00											', '50,00', '5 624.54', '2 460.74', 1, NULL, '2013-12-04 16:36:48'),
(132, '1100AD', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/ad_132.5.htm', 'Онлайн-игры', 0, 'Игра 1100AD - браузерная стратегия, предназначенная для большого количества игроков. Действие игры происходит в Средневековье.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=132', ' 													 - 											', '16,00 - 85,00', '3 291.63', '3 131.85', 1, NULL, '2013-12-04 16:36:48'),
(144, 'Sky2Fly', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/sky_fly_144.5.htm', 'Онлайн-игры', 1, 'Сюжет игры &mdash; Земля падает на Небо, где впоследствии зарождается новая облачная Цивилизация. Это браузерная игра в жанре 3D-авиа-шутера, где игрок выступает от третьего лица в роли пилота изначально простенького воздушного корабля и со временем прокачивает его параметры и возможности. Нет никаких пошаговых боев и обязательных сюжетных линий. Можно летать куда вздумается, выбирать любое занятие и выполнять огромное количество занимательных квестов, в которых игрок не только получает бонусы и опыт, но и может быть свидетелем и даже участником политических и любовных интриг, так что скучать не придется. Красивая графика и прорисовка производят очень хорошее впечатление и делают игру более занимательной и яркой.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=144', ' 													15,00											', '50,00', '2 972.06', '3 259.68', 1, NULL, '2013-12-04 16:36:48'),
(153, 'Battlestar Galactica Online', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/battlestar_galactica_online_153.5.htm', 'Онлайн-игры', 1, 'В основе создания бесплатной MMORPG игры лежит одноименный сериал. В данной Галактике существуют две расы на выбор игрока &mdash; Люди и Сайлоны (роботы). Модернизируя космические корабли, игрок может создать сильнейшее войско для захвата и уничтожения противника.&nbsp;С каждой завершенной миссией открываются неизведанные тайны Вселенной, а команда становится сильнее и получает новые навыки и возможности атак.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=153', ' 													2,16 - 6,48											', '9,50 - 30,23', '2 396.82', '2 556.61', 1, NULL, '2013-12-04 16:36:48'),
(157, 'OldBK', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/oldbk_157.5.htm', 'Онлайн-игры', 1, 'Бесплатная многопользовательская MMORPG игра, основанная на легендарном Бойцовском Клубе 2002-2003 годов.&nbsp;В ней сохранены традиции игры предшественника, но при этом добавлены новые возможности и действия.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=157', ' 													12,50											', '-', '3 227.72', '2 428.78', 1, NULL, '2013-12-04 16:36:48'),
(160, 'Karos Online', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/karos_online_160.5.htm', 'Онлайн-игры', 0, 'Яркая и реалистичная MMORPG фэнтези игра в режиме онлайн.\r\n	Действие игры происходит в ярком и реалистичном мире Азмара, важным элементом которого является флетта &ndash; мифическая субстанция, олицетворяющая собой силу земли.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=160', ' 													 - 											', '60,00 - 120,00', '6 806.97', '6 423.48', 1, NULL, '2013-12-04 16:36:48'),
(163, 'Осада Онлайн', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/osada_onlayn_163.5.htm', 'Онлайн-игры', 1, 'Осада онлайн &ndash; бесплатная клиентская онлайн-игра в жанре стратегия, представляющая игроку возможность участвовать в средневековых междоусобных войнах.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=163', ' 													 - 											', '4,00 - 24,00', '3 387.51', '2 428.78', 1, NULL, '2013-12-04 16:36:48'),
(171, 'Blood and Soul', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/blood_and_soul_171.5.htm', 'Онлайн-игры', 1, 'Blood and Soul &mdash; это ролевая онлайн игра в стиле романтического фентези.&nbsp;Игроку предстоит не только участвовать в боях на аренах против вражеских гильдий, но и признаваться в любви и даже проводить свадьбы.&nbsp;В игре очень продуманная система эмоций, что придает персонажу индивидуальный характер и позволяет по максимуму оживить его.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=171', ' 													 - 											', '40,00 - 100,00', '4 282.32', '3 195.76', 1, NULL, '2013-12-04 16:36:48'),
(180, '11x11 - 2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/x_180.5.htm', 'Онлайн-игры', 1, '', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=180', ' 													3,00											', '30,00 - 50,00', '6 231.73', '3 291.63', 1, NULL, '2013-12-04 16:36:48'),
(181, 'Короли льда - 2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/koroli_lda_181.5.htm', 'Онлайн-игры', 1, 'Жанр игры &mdash; хоккейный менеджмент. Игрок становится главным тренером и берет на себя создание, прокачивание и управление своей хоккейной командой, состоящей из 22 человек, чтобы участвовать в турнирах, кубках и матчах.&nbsp;Победа в турнирах повышает возможности и рейтинги команды, тем самым открывая дорогу к участию в &laquo;Кубковом Турнире&raquo;, который свидетельствует о высоком профессионализме игрока.&nbsp;Регулярные тренировки и разработка тактики командной игры позволяют команде более успешно двигаться к завоеванию кубка и званию &laquo;Королей Льда&raquo;.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=181', ' 													3,00											', '30,00 - 50,00', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:48'),
(182, 'Гладиаторы - 2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/gladiatoryi_182.5.htm', 'Онлайн-игры', 1, 'Гладиаторы - бесплатная онлайн игра, которая окунет игрока в мир жесточайших боев Древнего Рима.\r\n		В начале игрок получает в распоряжение свою гладиаторскую школу, в которую он должен нанять самых лучших и избранных воинов для проведения турниров, чемпионатов и соревнований. Это могут быть не только воины, но и гладиаторы разных типов: конные, колесничие, а также лучники.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=182', ' 													3,00											', '30,00 - 50,00', '4 250.36', '3 483.38', 1, NULL, '2013-12-04 16:36:48'),
(186, 'Меч и Магия: Герои Королевства', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/mech_i_magiya_geroi_korolevstva_186.5.htm', 'Онлайн-игры', 1, 'Продолжение легендарной бесплатной браузерной онлайн игры, выполненной в жанре стратегии, где игрок, принимая решения, влияет на развитие и модернизацию своего королевства, попутно сражаясь с врага-ми, объединяясь в группы с союзниками и выполняя различные квесты.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=186', ' 													32,00											', '-', '2 141.16', '1 821.58', 1, NULL, '2013-12-04 16:36:48'),
(188, 'Полный Пи', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/polnyiy_pi_188.5.htm', 'Онлайн-игры', 1, 'Полный Пи &ndash; браузерная онлайн игра в жанре комиксов и хоррора, повествующая о невообразимых легендах и предсказаниях конца света.&nbsp;В начале игрок выступает в роли невольного виновника глобальных разрушений и, по ходу прохождения, становится настоящим спасителем вселенной от гибели.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=188', ' 													 - 											', '7,20 - 54,40', '2 716.40', '3 004.01', 1, NULL, '2013-12-04 16:36:48'),
(192, 'Carnage', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/carnage_192.5.htm', 'Онлайн-игры', 1, 'Carnage &ndash; это бесплатная браузерная онлайн игра в стиле MMORPG. В ярком и разнообразном мире Carnage игрок может не только воевать, заниматься торговлей и развитием соей территории, общаться с другими пользователями, но и проводить виртуальные свадебные церемонии, которые с недавнего времени стали очень популярными среди онлайн игр.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=192', ' 													 - 											', '30,00 - 190,00', '9 299.66', '5 368.88', 1, NULL, '2013-12-04 16:36:48'),
(194, 'Банк Русский Стандарт: Кредитные карты', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_russkiy_standart_kreditnyie_kartyi_194.5.htm', 'Финансы и Банки', 0, 'ЗАО &laquo;Банк Русский Стандарт&raquo; основан в 1999 году и является одним из крупнейших национальных финансовых институтов федерального значения.\r\n	Придерживаясь самой высокой планки корпоративной этики и управления, Банк предоставляет высочайшее качество обслуживания, а менеджмент Банка следует международным принципам управления и прозрачности ведения бизнеса.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=194', ' 													 - 											', '550,00 - 2''100,00', '21 827.04', '23 297.09', 2, NULL, '2013-12-04 16:36:48'),
(196, 'Банк GE Money Bank: Кредиты', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_ge_money_bank_kredityi_196.5.htm', 'Финансы и Банки', 1, 'GE Money Bank &ndash; это одно из подразделений General Electric, основанный в 30-е года ХХ века и ранее занимающееся предоставлением кредитов населению на приобретение бытовой техники.\r\n	Сейчас основной специализацией Банка является оформление кредитных карт для предоставления потребительского кредитования и других финансовых операций.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=196', ' 													 - 											', '3''600,00', '0.00', '7 957.44', 2, NULL, '2013-12-04 16:36:48'),
(204, 'WikiMart', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/wikimart_204.5.htm', 'Одежда и обувь, Телефоны, Электроника и Фото, Бытовая техника, Компьютеры, Товары для строительства и ремонта, Спортивные товары, Оборудование, Товары для авто- и мототехники, Книги, Товары для детей, Товары для офиса, Товары для дома и дачи, Мебель, Подарки, сувениры, цветы, Товары для красоты и здоровья', 1, 'WikiMart&nbsp; &ndash; это онлайн-торговый центр, собравший на одном сайте огромный выбор товаров со всего мира и обслуживающий по несколько тысяч покупателей ежедневно.\r\n	Для клиентов всегда в наличии широкий ассортимент продукции, доступные цены, а также простой и безопасный процесс покупки через Интернет.\r\n	Все входящие звонки поступают в единый call-центр, где их обрабатывают квалифицированные специалисты, способные быстро и эффективно ответить на все вопросы и помочь с оформлением и доставкой товаров.\r\n	Для фирм-продавцов WiliMart предлагает уже готовую технологическую платформу для своего Интернет магазина и возможность торговать без начальных инвестиций.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=204', ' 													260,00											', '-', '8 021.36', '11 185.16', NULL, NULL, '2013-12-04 16:36:48'),
(210, 'Банк Хоум Кредит', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_houm_kredit_210.5.htm', 'Финансы и Банки, Услуги', 0, 'HomeCredit работает на территории России уже более 8 лет, став за это время одним из лидеров рынка кредитования.\r\n	Для своих клиентов Банк предоставляет широкий спектр услуг в области потребительского кредитования на выгодных условиях, успешно проводит депозитные операции для физических лиц, активно работает с дебетовыми картами, текущими счетами, развивает собственную сеть банкоматов, которые на данный момент насчитывают 278 единиц.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=210', ' 													230,00											', '-', '0.00', '11 440.82', 4, NULL, '2013-12-04 16:36:48'),
(215, 'Сапато', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/sapato_215.5.htm', 'Одежда и обувь', 0, 'Sapato.ru &ndash; крупнейший обувной интернет-магазин, на виртуальных витринах которого представлена огромная коллекция обуви и сумок лучших мировых брендов.\r\n	На выбор обувь немецких, итальянских, испанских производителей, а также стран Америки и Европы. Ассортимент постоянно пополняется новыми коллекциями женской, мужской и детской обуви. Кроме повседневной обуви, спортивной и деловой обуви есть возможность приобрести редкие эксклюзивные модели, которые не представлены в обычных розничных магазинах.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=215', ' 													 - 											', '12,00% - 19,00%', '23 712.54', '7 510.04', 5, NULL, '2013-12-04 16:36:48'),
(222, 'Банк ВТБ: Страхование', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_vtb_strahovanie_222.5.htm', 'Услуги, Финансы и Банки', 0, 'ООО СК &laquo;ВТБ Страхование&raquo; работает на рынке в России с 2000 года и предлагает частным лицам и корпоративным клиентам высококачественные услуги по страхованию. Это страхование ОСАГО и КАСКО, ипотечное и комплексное страхование, ответственности и имущества, страхование от несчастных случаев для граждан, выезжающих за рубеж.&nbsp;Компания входит ведущую международную финансовую группу ВТБ.\r\n	Главная цель и принцип компании &ndash; оказать клиентам высокий уровень обслуживания и контроль его качества.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=222', ' 													 - 											', '240,00', '0.00', '8 277.02', 6, NULL, '2013-12-04 16:36:49'),
(231, 'The Settlers Онлайн', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/the_settlers_onlayn_231.5.htm', 'Онлайн-игры', 1, 'Это бесплатная многопользовательская онлайн игра в жанре стратегии, аналогом которой является популярная в 90-х годах компьютерная версия.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=231', ' 													 - 											', '15,00 - 65,00', '2 268.99', '4 154.49', 1, NULL, '2013-12-04 16:36:49'),
(565, 'Связной', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/svyaznoy_565.5.htm', 'Электроника и Фото, Телефоны, Компьютеры, Товары для авто- и мототехники', 0, 'Связной является одной из крупнейших и известнейших компанией, специализирующейся на розничной продаже услуг сотовых операторов, средств связи, цифровой аудио- и фототехники, а также аксессуаров и входит в число лучших среди ассортимента и демократичности цен. Кроме основных услуг, сеть магазинов предлагает ряд дополнительных сервисов, таких как прием платежей без комиссии, оформление полисов автострахования, подключение НТВ+, замена старого телефона на новый с доплатой, покупка товаров в кредит, SMS-сервисы и многое другое.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=565', ' 													 - 											', '2,61% - 3,91%', '4 889.51', '9 171.83', 7, NULL, '2013-12-04 16:36:49'),
(567, 'Forsaken World', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/forsaken_world_567.5.htm', 'Онлайн-игры', 0, 'Forsaken World &ndash; это клиентская онлайн MMORPG игра, главный проект от компании Perfect World, наполненная забытыми тайнами, опасными экспедициями и несметными сокровищами. В этом мире игрока ждут километры неисследованных территорий и увлекательных путешествий: исследуйте загадки древних гробниц, бейтесь за славу в небесах мира Эйры, пускайтесь в опасные экспедиции к горным пикам и заполучите могущество древних артефактов. В Forsaken World обыденность отступит на второй план, когда в череде событий ты пройдешь путь от неизвестного странника до величайшего героя.\r\n	PvP-войны между гильдиями позволят игрокам накапливать количество баллов для того, чтобы потом призвать своего Бога. Богом могут стать только 10 игроков на сервере.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=567', ' 													 - 											', '92,00', '4 793.64', '5 592.58', 1, NULL, '2013-12-04 16:36:49'),
(568, 'Drakensang Online', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/drakensang_online_568.5.htm', 'Онлайн-игры', 1, '', '', ' 													9,93 - 19,86											', '33,25 - 66,07', '2 364.86', '2 396.82', 1, NULL, '2013-12-04 16:36:49'),
(573, 'Драконы', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/drakonyi_573.5.htm', 'Онлайн-игры', 1, 'Драконы &ndash; это браузерная онлайн-игра, переносящая игрока в мир Тарт, где когда-то давным-давно шла война объединившихся земных народов против древних богов, освободившихся на волю. И только одна раса &ndash; Тангоры &ndash; использовала битву для своего блага, чтобы захватить землю и поднебесья. Разными способами они заключили в рабство могущественных драконов, но тут вмешались люди и уничтожили и Тангоров, и богов.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=573', ' 													 - 											', '27,00 - 123,00', '4 282.32', '3 802.95', 1, NULL, '2013-12-04 16:36:49'),
(576, 'Romadoria', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/romadoria_576.5.htm', 'Онлайн-игры', 1, 'Romadoria &ndash; это бесплатная онлайн игра в жанре стратегии, события в которой происходят во времена Древнего Рима, когда страной правил великий император Юлий Цезарь. Для игры доступны 2 локации: Италия и Испания. Суть заключается в том, что игроку нужно развивать собственную колонию в глобальном и экономическом плане для того, чтобы стать главой Провинции, а затем в итоге и всего Мира.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=576', ' 													5,00											', '50,00', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:49'),
(579, 'Tvigle', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/tvigle_579.5.htm', 'Онлайн-сервисы, Видео', 0, 'Tvigle.ru представляет собой развлекательный портал с размещенными на нем качественными видеороликами. Это сайт, объединяющий любителей и профессионалов в области кинематографии.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=579', ' 													0,15											', '-', '0.00', '0.00', 8, NULL, '2013-12-04 16:36:49'),
(590, 'ЛитРес', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/litres_590.5.htm', 'Книги, Электроника и Фото, Подарки, сувениры, цветы', 0, 'ЛитРес &ndash; это интернет-магазин, направленный на продажу электронных книг.\r\n	На сегодняшний день ЛитРес является лидером на рынке распространения лицензионной продукции в России и странах СНГ.\r\n	В каталоге магазина представлено свыше 200 000 лицензионных электронных книг и аудиокниг.\r\n	Для того чтобы скачать нужную книгу, необходимо всего лишь зарегистрироваться и совершить оплату. После приобретении книги клиент может скачивать ее неограниченное количество раз.\r\n	Покупая книги, вы оплачиваете труд ваших любимых авторов, а также редакторов, корректоров, верстальщиков и других людей, стремящихся сделать вашу жизнь немного интереснее.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=590', ' 													 - 											', '4,00% - 20,00%', '0.00', '0.00', 140, NULL, '2013-12-04 16:36:49'),
(594, 'Grepolis', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/grepolis_594.5.htm', 'Онлайн-игры', 1, 'Grepolis &ndash;&nbsp; это бесплатная браузерная стратегическая онлайн-игра, где у игрока есть возможность стать великим полководцем и почувствовать себя в роли Александра Македонского.\r\n	Вы получаете маленькую деревушку под свое командование и начинаете развивать ее. Для развития существует 4 основных ресурса: камень, дерево, серебро и благословление богов &ndash; ресурс, получаемый при строительстве статуй и храмов.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=594', ' 													12,95											', '-', '2 844.23', '2 428.78', 1, NULL, '2013-12-04 16:36:49'),
(599, 'Seafight', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/seafight_599.5.htm', 'Онлайн-игры', 1, 'Seafight &ndash; это многопользовательская браузерная онлайн-игра от компании-разработчика BigPoint, созданная в пиратском жанре.\r\n	В начале игрок получает команду из нескольких человек, золото для покупки корабля, инвентаря, а также немного жемчуга, который является основной игровой валютой, ведь с помощью него появляется возможность приобретения более сильных единиц боевого судна, оружия и разной амуниции. Еще одна валюта &ndash; наличные, оплачивая покупки и собирая таким образом очки, игрок может участвовать в ежемесячном джекпоте, призом которого является сумма в $10 000.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=599', ' 													1,30 - 4,32											', '8,64 - 25,91', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:49'),
(601, 'Правила войны. Ядерная стратегия', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/pravila_voynyi_yadernaya_strategiya_601.5.htm', 'Онлайн-игры', 1, 'Правила Войны. Ядерная стратегия &ndash; игра-приложение от компании Plarium в стратегическом жанре. Появившись сравнительно недавно, она получила огромный успех среди подобных приложений ВКонтакте.\r\n	Игра начинается с обучения, проводимым харизматичным генералом Лапидусом. После выполнения около 50 заданий, игрок получает не только награды, но и справку от генерала, которая очень пригодится при прохождении.\r\n	На протяжении всей игры игроку предстоит отстраивать свой форт, создавать армию, захватывать рудники, участвовать в войнах между кланами, а также воевать с главными злодеями &ndash; Гадами.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=601', ' 													 - 											', '16,00 - 69,00', '3 802.95', '3 259.68', 1, NULL, '2013-12-04 16:36:49'),
(604, 'TOPBRANDS', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/topbrands_604.5.htm', 'Одежда и обувь', 0, 'TOPBRANDS &ndash; это интернет-магазин, предоставляющий своим покупателям большой выбор брендовой одежды, сумок, обуви и аксессуаров премиум-класса. Только здесь покупатель может обновить свой гардероб как по брендам и коллекциям, так и подобрать наиболее стильные и модные комплекты одежды с помощью стилистов.\r\n	Опытные менеджеры готовы помочь покупателю в выборе и ответить на все вопросы, а также дать полезные советы и консультации.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=604', ' 													 - 											', '12,00%', '0.00', '0.00', 5, NULL, '2013-12-04 16:36:49'),
(609, 'ВидеоКлуб', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/videoklub_609.5.htm', 'Видео, Онлайн-сервисы', 0, 'Видеоклуб представляет собой бесплатный сайт-чат для знакомств и видео-общения как со случайными людьми, так и с родственниками и друзьями в разных городах и точках мира. Для этого необходимы всего два устройства: микрофон и веб-камера.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=609', ' 													 - 											', '16,00', '0.00', '0.00', 10, NULL, '2013-12-04 16:36:49'),
(610, 'Пираты Онлайн', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/piratyi_onlayn_610.5.htm', 'Онлайн-игры', 1, 'Пираты &ndash; клиентская онлайн-игра, которая перенесет игрока во времена, когда пираты бороздили пространство морей, грабили честных путешественников, рисовали карты и искали клады.\r\n	На выбор игроку дается один из четырех основных персонажей, внешность которого можно менять на свое усмотрение, экипировывать его самым лучшим оружием, предметами одежды, а также развивать новые умения и навыки.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=610', ' 													 - 											', '12,00', '2 684.44', '1 821.58', 1, NULL, '2013-12-04 16:36:49'),
(611, 'Небеса', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/nebesa_611.5.htm', 'Онлайн-игры', 1, 'Небеса &ndash; это многопользовательская браузерная онлайн-игра, сочетающая в себе сразу несколько жанров: RPG, фэнтези, стратегия и ММО.\r\n	Первоначально Небеса были приложением ВКонтакте, но, набрав большое количество фанатов, разработчики решили создать полноценную игру с официальным сайтом.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=611', ' 													 - 											', '16,00 - 24,00', '2 268.99', '2 045.29', 1, NULL, '2013-12-04 16:36:49'),
(627, 'Royal Quest', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/royal_quest_627.5.htm', 'Онлайн-игры', 1, 'Клиентская MMORPG онлайн-игра Royal Quest была выпущена в апреле 2012 года российской компанией Katauri Interactive.\r\n	Действие игры происходит в мире Аура, которому грозит опасность в виде черных алхимиков, пытающихся заполучить в свое распоряжение минерал элениум.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=627', ' 													 - 											', '15,00 - 73,00', '6 423.48', '5 784.33', 1, NULL, '2013-12-04 16:36:49'),
(629, 'TVzavr', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/tvzavr_629.5.htm', 'Онлайн-сервисы, Видео', 0, 'TVzavr предлагает пользователям бесплатный просмотр лицензионного видео в онлайн-режиме.\r\n	Это различные по жанру фильмы, сериалы, образовательные и обучающие программы, трансляция спортивных мероприятий, виртуальных экскурсий и многое другое.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=629', ' 													0,14											', '-', '58 993.74', '6 231.73', 8, NULL, '2013-12-04 16:36:49'),
(635, 'Elitdress', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/elitdress_635.5.htm', 'Одежда и обувь', 0, 'Компания ElitDress предлагает своим покупателям красивые, стильные и качественные товары от ведущих российских и зарубежных производителей. В ассортименте интернет-магазина представлены коллекции мужской и женской одежды, а также обувь и аксессуары. Все сезонные коллекции обновляются еженедельно и поступают в каталог ElitDress на два-три месяца раньше, чем в свободной продаже на прилавках магазинов, поэтому покупатель имеет возможность заказать понравившуюся вещь еще до начала сезона, что является несомненным плюсом и отличием от других подобного рода интернет-магазинов.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=635', ' 													 - 											', '1''000,00\r\n10,00%', '0.00', '0.00', 5, NULL, '2013-12-04 16:36:49'),
(638, 'Постелин', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/postelin_638.5.htm', 'Товары для дома и дачи', 1, 'Postelin.ru &ndash; это уникальный интернет-магазин, созданный в 2009 году и занимающийся продажей качественных, красивых и модных комплектов постельного белья.\r\n	Тщательно проанализировав предпочтения покупателей по всей России, магазин включил в свой ассортимент только самые популярные и любимые покупателями марки постельного белья российских и зарубежных производителей, которые получили множество хороших отзывов и зарекомендовали себя как лидеры российского рынка.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=638', ' 													 - 											', '-', '0.00', '5 816.28', 11, NULL, '2013-12-04 16:36:49'),
(643, 'Piratestorm', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/piratestorm_643.5.htm', 'Онлайн-игры', 1, 'Piratestorm &ndash; это браузерная онлайн-игра в пиратском стиле, в которой игроку предстоит почувствовать себя отважным пиратом, отправиться на поиски несметных сокровищ и затонувших кораблей, стать свидетелем открытия новых территорий, а также принять участие в захватывающих приключениях на суше и на море.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=643', ' 													2,16 - 5,18											', '15,98 - 59,59', '3 227.72', '2 748.35', 1, NULL, '2013-12-04 16:36:50');
INSERT INTO `offers` (`id`, `name`, `offerlink`, `category`, `locked`, `description`, `bannerlink`, `cpl`, `cpa`, `epc7d`, `epc90d`, `category_id`, `created_at`, `updated_at`) VALUES
(644, 'Удиви', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/udivi_644.5.htm', 'Подарки, сувениры, цветы', 1, 'Удиви &ndash; интернет-магазин удивительных и оригинальных подарков для любого случая. На его страницах покупатель найдет яркие и необычные подарки по приемлемым ценам для друзей, родственников и любимых. Магазин постоянно работает над улучшением своего сервиса и сейчас уже готов предложить несколько приятных и конкурентных преимуществ в виде дисконтной карты на 10% при покупке от 1500 руб., креативного сувенира для всех без исключения покупателей и самой дешевой доставки товара в размере 150 руб. в пределах МКАД. Оплата производится при получении товара, через банк на расчетный счет или терминал QIWI. Доставка курьерской службой, через сервис EMS Russian Post или самовывоз.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=644', ' 													180,00											', '-', '3 355.55', '3 771.00', 141, NULL, '2013-12-04 16:36:50'),
(645, 'Ellos', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/ellos_645.5.htm', 'Одежда и обувь, Товары для дома и дачи, Товары для детей', 0, 'Интернет-магазин Ellos предлагает своим посетителям широкий выбор мужской, женской и детской одежды, обуви, текстиля для дома, а также большой ассортимент нижнего белья, купальников и аксессуаров по выгодным ценам.\r\n	Это только яркие и модные коллекции, которые не только постоянно обновляются, но и долго прослужат покупателям, благодаря изготовлению из качественного и сертифицированного сырья.\r\n	Для тех, кто активно следит за модными тенденциями, магазин Ellos пополняет специальный блог интересными статьями о мире моды и новых поставках товара.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=645', ' 													 - 											', '615,00', '0.00', '4 537.98', 13, NULL, '2013-12-04 16:36:50'),
(647, 'Shoptime', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/shoptime_647.5.htm', 'Одежда и обувь, Подарки, сувениры, цветы', 0, 'Если вы цените удобство, стиль и качество, то интернет-магазин ShopTime &ndash;&nbsp; идеальное предложение для успешного онлайн-шоппинга.\r\n	ShopTime предлагает огромный выбор женской, мужской и детской одежды, обуви и аксессуаров различных мировых брендов, доступных для клиента в круглосуточном режиме.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=647', ' 													 - 											', '16,50%', '10 482.09', '20 005.46', 142, NULL, '2013-12-04 16:36:50'),
(649, 'Белый Ветер Цифровой', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/belyiy_veter_tsifrovoy_649.5.htm', 'Компьютеры, Электроника и Фото, Телефоны, Бытовая техника', 0, 'Компания Белый Ветер Цифровой была основана Юрием Дубовицким более 20 лет назад и сейчас является одной из лидирующих на рынке цифрового и компьютерного ритейла.\r\n	Именно Белый Ветер впервые предложила покупателям возможность предварительного заказа товаров, покупок через интернет и по телефону.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=649', ' 													 - 											', '3,00%', '38 924.36', '5 336.92', 15, NULL, '2013-12-04 16:36:50'),
(663, 'Lamoda', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/lamoda_663.5.htm', 'Одежда и обувь', 0, 'Свою работу интернет-магазин Lamoda начал в 2011 году и, благодаря успешным сделкам и поддержке со стороны крупных компаний, сейчас является одним из топовых магазинов по продаже одежды, обуви и аксесуаров от мировых брендов, а также товаров для дома.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=663', ' 													 - 											', '5,00% - 15,00%', '0.00', '6 775.01', 5, NULL, '2013-12-04 16:36:50'),
(664, 'Proskater', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/proskater_664.5.htm', 'Подарки, сувениры, цветы, Товары для детей, Одежда и обувь', 0, 'Интернет-магазин Proskater предлагает огромный ассортимент товаров, одежды и аксессуаров для скейтбординга и активного образа жизни. На прилавках магазина вы найдете всю необходимую экипировку, а также современную мужскую, женскую, детскую одежду и обувь таких известных производителей как Converse, DC Shoes, Circa, Roxy, Quiksilver, Audi, Vans, Globe и многих других.\r\n	Все товары разбиты по фирмам и категориям, что позволяет без проблем найти нужный бренд, модель, размер, а также определить ценовые рамки.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=664', ' 													 - 											', '12,00% - 16,50%', '0.00', '0.00', 143, NULL, '2013-12-04 16:36:50'),
(672, 'Уральский Банк Реконструкции и Развития', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/uralskiy_bank_rekonstruktsii_i_razvitiya_672.5.htm', 'Финансы и Банки', 1, 'УБРиР был создан в 1990 году и на сегодняшний день является крупнейшим банком в Свердловской области, занимая высокие позиции в ТОП-100 кредитных организаций Российской Федерации.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=672', ' 													90,00											', '-', '22 657.94', '25 789.79', 2, NULL, '2013-12-04 16:36:50'),
(674, 'Ivi', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/ivi_674.5.htm', 'Онлайн-сервисы, Видео, Спортивные товары', 0, 'ivi.ru является первым видеосервисом с лицензионным контентом, где можно смотреть фильмы, сериалы, мультфильмы, видеоклипы и даже ТВ-программы в онлайн-режиме.\r\n	Проект был запущен в действие 26 февраля 2010 года при поддержке компании Digital Access, и за первый день своего существования его посетили более 180 000 человек, что помогло сервису стать самым успешным запуском за всю историю Рунета.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=674', ' 													0,48											', '-', '13 518.07', '4 857.56', 17, NULL, '2013-12-04 16:36:50'),
(685, 'Panzar', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/panzar_685.5.htm', 'Онлайн-игры', 0, '', '', ' 													65,00											', '50,00 - 200,00', '6 870.88', '8 340.93', 1, NULL, '2013-12-04 16:36:50'),
(687, 'Alvegia Online: BattleField', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/alvegia_online_battlefield_687.5.htm', 'Онлайн-игры', 1, 'Alvegia Online: Battle Field &ndash; динамичная массовая онлайн-игра, сочетающая в себе элементы стратегии в реальном времени, тактики и ролевой игры. Две враждующие стороны, до 5 уникальных по стратегии и внешности героев в каждой, сражаются друг с другом с целью уничтожить &laquo;сердце&raquo; базы &ndash; Сосредоточие Могущества. Стражи под управлением игроков получают опыт и золото во время игры, что позволяет развивать уникальные навыки и приобретать предметы, увеличивающие силу героя.\r\n	Командное взаимодействие, быстрота реакции и стратегическое мышление &ndash; залог успешной игры и неминуемой победы.\r\n	Особенности игры:\r\n	- регулярные обновления и постоянно растущий список неповторимых героев, а также выбор своего стиля игры;\r\n	- умная система автоматического подбора игроков;\r\n	- постоянно обновляющийся рейтинг стражей и рейтинг лучших героев, который позволяет заявить о себе всего за одну партию;\r\n	- уникальная возможность развития героя с помощью рун. Стань сильнее еще до начала битвы!\r\n	- шанс получить героя бесплатно еще на этапе обучения;\r\n	- партии с ограниченным доступом. Играй только с тем, с кем хочешь играть!\r\n	- система возвращения в партию после вылета. Не бойся разрывов связи!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=687', ' 													 - 											', '42,00 - 115,00', '0.00', '3 771.00', 1, NULL, '2013-12-04 16:36:50'),
(690, 'Наноденьги', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/nanodengi_690.5.htm', 'Финансы и Банки', 1, 'Наноденьги &ndash; это быстрый и безопасный способ получения займа от 10 000 до 40 000 рублей, не выходя из дома.\r\n	Для получения займа клиенту необходимо заполнить анкету на сайте компании, после чего менеджер сам приедет к нему домой или в офис, оформит все необходимые документы и уже через сутки, при одобрении заявки, деньги будут перечислены на банковский счет заемщика.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=690', ' 													 - 											', '130,00', '11 217.12', '10 546.01', 2, NULL, '2013-12-04 16:36:50'),
(691, 'Prime World', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/prime_world_691.5.htm', 'Онлайн-игры', 1, 'Ролевая стратегия Prime World от создателей игр Heroes of Might &amp; Magic V, &laquo;Блицкриг&raquo; и &laquo;Демиурги&raquo; впервые в жанре соединяет динамичные многопользовательские бои с вдумчивым развитием замка.\r\n	Покажи свое мастерство на разнообразных полях сражений: от агрессивного &laquo;Форпоста&raquo;, мрачного и полного сюрпризов &laquo;Драгонвальда&raquo; до стратегической &laquo;Родной Земли&raquo; и классического &laquo;Пограничья&raquo;.\r\n	Строй собственный замок, управляй экономикой, нанимай и совершенствуй героев. Система талантов позволяет каждому создать уникального персонажа и удивить врагов нетривиальной комбинацией способностей.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=691', ' 													 - 											', '116,00', '5 560.62', '5 081.26', 1, NULL, '2013-12-04 16:36:50'),
(692, 'Kupibonus', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/kupibonus_692.5.htm', 'Купонные сервисы', 0, 'На сайте компании Kupibonus клиенты могут найти огромное количество товаров и услуг по выгодным условиям и скидкам, которые достигают 90%.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=692', ' 													 - 											', '-', '0.00', '0.00', 18, NULL, '2013-12-04 16:36:50'),
(708, 'Ozon Travel', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/ozon_travel_708.5.htm', 'Путешествия, туризм', 0, 'Ozon Travel &ndash; это одно из крупнейших онлайн-агентств по бронированию билетов и гостиниц в России и заграницей. На данный момент агентство предлагает воспользоваться услугами около 500 авиакомпаний по всему миру, а также огромной базой отелей и гостиниц, количество которых превышает 150 000. На сайте клиенты могут не только сделать заказ, но и оформить страховку, получить полезную информацию о визе и других важных вопросах и приобрести подарочные сертификаты для следующих покупок. Оплатить заказы можно с помощью банковского перевода, электронными деньгами или в салонах сотовой связи.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=708', ' 													5,08											', '27,00\r\n3,50% - 10,17%', '20 388.95', '9 203.79', 144, NULL, '2013-12-04 16:36:50'),
(711, 'Travian', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/travian_711.5.htm', 'Онлайн-игры', 1, 'Travian является одной из популярнейших бесплатных браузерных онлайн-игр в мире.\r\n	Это захватывающая стратегия, где бои проходят в реальном времени.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=711', ' 													13,39 - 44,04											', '-', '5 720.41', '3 994.70', 1, NULL, '2013-12-04 16:36:50'),
(713, 'Miramagia', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/miramagia_713.5.htm', 'Онлайн-игры', 1, 'Miramagia &ndash; бесплатная браузерная онлайн-игра в фэнтэзийном жанре, наполненная магическими и удивительными существами. Игрок может участвовать не только в увлекательных приключениях, защищая свою деревню от монстров и других врагов, но и заниматься домашним хозяйством: выращивать и следить за развитием магических растений на своем земельном участке, предоставленном в начале игры.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=713', ' 													16,41											', '-', '3 611.21', '2 748.35', 1, NULL, '2013-12-04 16:36:50'),
(795, 'Forge of Empires', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/forge_of_empires_795.5.htm', 'Онлайн-игры', 1, 'Forge of Empires &ndash; это бесплатная браузерная игра от компании InnoGames в стратегическом жанре.\r\n	Игроку предстоит создать свой город практически из пустого места и править им долгие поколения и эпохи, начав с Каменного Века.\r\n	Стройте различные здания, которые позже приобретут историческое значение, расширяйте территории, налаживайте торговые связи с другими игроками и населенными пунктами, выходите в военные походы.\r\n	Чтобы попасть в новую эпоху, необходимо изучать множество технологий по постройке, а также выполнять интересные квесты и задания.\r\n	Сражения проходят в PvP-режиме, игроки могут выходить на бой один на один или войско на войско.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=795', ' 													9,93 - 26,34											', '-', '4 378.19', '4 569.94', 1, NULL, '2013-12-04 16:36:51'),
(815, 'Драконы - 2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/drakonyi_815.5.htm', 'Онлайн-игры', 0, 'Драконы &ndash; это браузерная онлайн-игра, переносящая игрока в мир Тарт, где когда-то давным-давно шла война объединившихся земных народов против древних богов, освободившихся на волю. И только одна раса &ndash; Тангоры &ndash; использовала битву для своего блага, чтобы захватить землю и поднебесья. Разными способами они заключили в рабство могущественных драконов, но тут вмешались люди и уничтожили и Тангоров, и богов.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=815', ' 													 - 											', '20,00%', '0.00', '27 675.29', 1, NULL, '2013-12-04 16:36:51'),
(825, 'Сотмаркет', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/sotmarket_825.5.htm', 'Оборудование, Компьютеры, Электроника и Фото, Телефоны, Товары для красоты и здоровья, Подарки, сувениры, цветы, Мебель, Товары для детей, Товары для авто- и мототехники, Спортивные товары, Товары для строительства и ремонта, Музыка, Аптека, Бытовая техника', 0, 'Сотмаркет занимается продажей таких необходимых в современном мире электронных девайсов как ноутбуки, планшеты, смартфоны и аксессуары к ним. Это интернет-магазин с самыми доступными ценами и огромным ассортиментом качественных товаров, который ежедневно пополняется новинками.\r\n	Доставка осуществляется на всей территории РФ без предоплаты, вы можете отслеживать заказы в Личном Кабинете, по СМС или электронной почте.\r\n	Также покупатель может оформить кредит на любой товар в онлайн-режиме!\r\n	Сотмаркет любит своих клиентов, предоставляет им самый лучший и оперативный сервис в круглосуточном режиме, а постоянных покупателей ждут приятные подарки и уникальные предложения.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=825', ' 													 - 											', '3,00% - 25,00%', '30 455.60', '17 672.56', NULL, NULL, '2013-12-04 16:36:51'),
(845, 'Банк Москвы', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_moskvyi_845.5.htm', 'Финансы и Банки', 0, '', '', ' 													 - 											', '800,00 - 2''135,00', '4 154.49', '4 953.43', 2, NULL, '2013-12-04 16:36:51'),
(905, 'TopShop', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/topshop_905.5.htm', 'Товары для дома и дачи', 0, 'TopShop &ndash; это интернет-магазин, предлагающий своим клиентам огромный выбор различных товаров: от подарков и сувениров до бытовой техники, одежды и обуви.\r\n	Основными торговыми марками магазина являеются Dormeo, Delimano и Kosmodisk. Именно они предоставляют лучшие товары для красоты и здоровья, дома и сада, спорта и автомобиля, электронику и бытовую технику, которые так необходимы в современном мире.\r\n	TopShop любит своих клиентов, об этом свидетельствуют частые акции, а также возможность вступить в &laquo;Клуб 5*&raquo;, чтобы сделать свои покупки еще выгоднее и приятнее.\r\n	Доставка осуществляется курьерской службой по всей территории России, клиенты дополнительно могут заказать сборку и монтаж сложных товаров.\r\n	Оплатить заказы можно любым способом: банковской картой, наложенным платежом, наличными или электронными деньгами.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=905', ' 													 - 											', '0,34% - 11,53%', '4 314.28', '7 062.63', 11, NULL, '2013-12-04 16:36:51'),
(925, 'Heverest', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/heverest_925.5.htm', 'Одежда и обувь', 0, 'Heverest.ru &ndash; крупнейший в России спортивный интернет-магазин, предлагающий более 30 000 товаров и 350 брендов оборудования, инвентаря, одежды, обуви и аксессуаров для спорта, туризма и активного образа жизни.\r\n	В коллекции Heverest всегда можно найти тренажеры и оборудование ведущих мировых брендов Body Sculpture, Torneo, Atemi HouseFit, товары для туризма и путешествий Alexika, Nova Tour, Tatonka, Trek Planet, одежду и обувь Nike, Puma, Asics, Timberland, New Balance, Mizuno, Salomon.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=925', ' 													 - 											', '10,20% - 13,55%', '0.00', '34 642.04', 5, NULL, '2013-12-04 16:36:51'),
(985, 'Royal Quest - 2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/royal_quest_985.5.htm', 'Онлайн-игры', 0, 'Клиентская MMORPG онлайн-игра Royal Quest была выпущена в апреле 2012 года российской компанией Katauri Interactive.\r\n	Действие игры происходит в мире Аура, которому грозит опасность в виде черных алхимиков, пытающихся заполучить в свое распоряжение минерал элениум.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=985', ' 													 - 											', '11,50 - 50,00', '3 834.91', '3 227.72', 1, NULL, '2013-12-04 16:36:51'),
(995, 'Cultures Online - 3', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/cultures_online_995.5.htm', 'Онлайн-игры', 0, 'Cultures Online &ndash; это бесплатная стратегическая онлайн-игра с элементами RPG.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=995', ' 													 - 											', '38,00%', '11 856.27', '12 495.42', 1, NULL, '2013-12-04 16:36:51'),
(1005, 'The Settlers Онлайн - 4', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/the_settlers_onlayn_1005.5.htm', 'Онлайн-игры', 0, 'Это бесплатная многопользовательская онлайн игра в жанре стратегии, аналогом которой является популярная в 90-х годах компьютерная версия.\r\n	В начале игрок&nbsp; - губернатор деревенского центра, которому нужно развить свою деревню путем постройки зданий по добыче различных полезных ресурсов. Таким образом, деревня превращается в город, который требует еще большего развития.\r\n	Теперь игрок должен следить за порядком, ловить бандитов и разбойников, строить более современные заводы и фабрики, тем самым расширяя свои территории.\r\n	Пока в игре нет возможности воевать против других игроков, но в скором времени эта функция будет доступна!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1005', ' 													 - 											', '38,00%', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:51'),
(1015, 'Зов Дракона - 3', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/zov_drakona_1015.5.htm', 'Онлайн-игры', 0, 'Зов Дракона - бесплатная браузерная онлайн-игра в жанре MMORPG, мир которой населяют фентезийные существа. Игрок создает своего персонажа, ограничиваясь только одной расой (люди) и выбором одного из трёх классов: воины, ассасины и маги. В игре представлено множество квестов, возможность выбирать работу с оплатой и получением опыта, трудиться в других городах, участвовать в боях на арене, совершать грабежи мирных путников и многое другое. Чтобы увеличить шансы на победу в боях, участники могут объединяться в гильдии, пользуясь привилегией в виде общего склада и создания гильдейских построек.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1015', ' 													 - 											', '38,00%', '9 715.11', '1 949.41', 1, NULL, '2013-12-04 16:36:51'),
(1085, 'Aviasales', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/aviasales_1085.5.htm', 'Путешествия, туризм, Услуги, Финансы и Банки', 0, 'AviaSales успешно стартовал в 2008 году и изначально создавался как удобная для основателя RSS-лента, которая позже стала интересна путешественникам и выросла в большой проект по рассылкам спецпредложений. На сегодняшний день сайт AviaSales полон разными выгодными предложениями по дешевым авиабилетам. С помощью удобной системы поиска и современных технологий, клиент быстро и точно сможет найти самые лучшие варианты рейсов от 728 авиакомпаний в России, СНГ и всему миру. Кроме этого, AviaSales предлагают дополнительные услуги в виде поиска гостининиц и транспорта в стране путешествия.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1085', ' 													 - 											', '1,15%', '0.00', '0.00', 146, NULL, '2013-12-04 16:36:51'),
(1125, 'Банк Тинькофф Кредитные Системы: Кредитные карты 2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_tinkoff_kreditnyie_sistemyi_kreditnyie_kartyi_1125.5.htm', 'Финансы и Банки', 0, 'ЗАО Банк Тинькофф Кредитные Системы был создан в 2006 году предпринимателем Тиньковым Олегом. На данный момент это современный и надежный Банк, предоставляющий кредиты с возможностью оформления кредитных карт через Интернет. Главная задача Банка - обеспечить обслуживание населения по всей России по самому высокому уровню. Так как все вопросы с клиентами решаются посредством современных каналов связи, в офисах никогда нет очередей, что является несомненным плюсом как, в первую очередь, для населения, так и для сотрудников. Этот факт и то, что основная специализация Банка: кредитные карты, а также широкий спектр предложений и программ, гибкие условия погашения кредитов обеспечивают Банку огромную конкурентоспособность.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1125', ' 													 - 											', '1''200,00', '13 709.81', '14 157.22', 2, NULL, '2013-12-04 16:36:51'),
(1135, 'Tom Tailor', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/tom_tailor_1135.5.htm', 'Одежда и обувь, Товары для детей', 0, 'Tom Tailor &ndash; это международная компания, осуществляющая продажу стильной и качественной одежды для детей, взрослых и молодёжи. Основанная еще в 1962 году, сейчас Tom Tailor является проверенной компанией, которая продолжает развиваться и предлагать своим клиентам самые интересные и яркие модели одежды. Ежегодно компания выпускает до 12 коллекций для каждой из 5 линий одежды: MEN CASUAL , WOMAN CASUAL, KIDS, MINIS и BABY, успешно продаваемые во всем мире по доступным и демократичным ценам. В число дополнительных продуктов компании входят еще 19 групп товаров с логотипом компании такие как сумки, обувь, белье, зонты и другие аксессуары.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1135', ' 													 - 											', '17,00%', '0.00', '0.00', 22, NULL, '2013-12-04 16:36:51'),
(1165, 'Альфа Страхование. Имущество физических лиц', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/alfa_strahovanie_imuschestvo_fizicheskih_lits_1165.5.htm', 'Услуги, Финансы и Банки', 0, 'Группа &quot;АльфаСтрахование&quot; уже более 20 лет на рынке и предлагает широкий спектр страховых продуктов, из которых каждый клиент может выбрать программу с необходимым ему набором услуг. Высший рейтинг надежности и удобное оформление полисов онлайн (страхование квартиры, личного имущества)\r\n	Застрахуйте свое имущество в &quot;АльфаСтрахование&quot; чтобы избежать финансовых потерь на случай грабежа или нападения.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1165', ' 													 - 											', '235,00', '0.00', '0.00', 6, NULL, '2013-12-04 16:36:51'),
(1365, 'My Lands - 1', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/my_lands_1365.5.htm', 'Онлайн-игры', 0, 'My Lands - браузерная онлайн-стратегия с возможностью вывода игровых денег в реальные. Эта MMORPG не требует установки на компьютер &ndash; достаточно выйти в интернет с любого браузера и начать игру. Графика этой военно-экономической стратегии в реальном времени вдохновлена Heroes of Might and Magic, а сама игра признана &laquo;Лучшей браузерной игрой 2010 года&raquo; по мнению ConfOg. Четыре классические расы на выбор: эльфы, дроу (темные эльфы), рыцари и демоны позволяют определенные бонусы в игре, а битва 2 фракций &ndash; Темной (дроу и демоны) и Светлой (рыцари и эльфы) &ndash; делают игру интереснее.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1365', ' 													 - 											', '40,00%', '0.00', '5 784.33', 1, NULL, '2013-12-04 16:36:51'),
(1375, 'Банк Ренесcанс Кредит: Кредитные карты 2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_renescans_kredit_kreditnyie_kartyi_1375.5.htm', 'Финансы и Банки', 0, '', '', ' 													 - 											', '800,00', '34 226.59', '27 451.58', 2, NULL, '2013-12-04 16:36:51'),
(1455, 'King Stars', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/king_stars_1455.5.htm', 'Онлайн-игры', 1, 'King Stars &ndash; это браузерная онлайн-игра для всех любителей космического экшена. После простой регистрации игрок получает своего персонажа, межгалактический корабль, а также планету, которую ему и предстоит развивать по ходу игры: строить здания и новые космические корабли, развивать войска, разрабатывать оружие, нанимать советников для получения инструкций и стратегий по завоеванию других планет и даже галактик. Принимайте участие в квестах, за которые вы будете получать бонусы в виде очков и ресурсов, необходимых для вашего дальнейшего развития, общайтесь, объединяйтесь и набирайтесь опыта у других игроков. За дополнительную плату вы можете ускорить практически все процессы игры, чтобы как можно скорее стать настоящим и единственным Повелителем Вселенной.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1455', ' 													 - 											', '5,60 - 52,00', '3 739.04', '2 460.74', 1, NULL, '2013-12-04 16:36:51'),
(1565, 'МигКредит', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/migkredit_1565.5.htm', 'Финансы и Банки', 1, 'Компания МигКредит занимается предоставлением займов физическим лицам, финансовые ресурсы которых ограничены и нет возможности получить кредит в банке.\r\n	Это одна из лидирующих на рынке микрофинансирования компаний с деятельностью, направленной на честное ведение бизнеса. Придерживаясь всем международным стандартам, МигКредит за время работы смогла зарекомендовать себя как надежный и проверенный партнер, предоставляющий качественные услуги и продукты на честных и выгодных клиенту условиях: простая схема погашения кредитов, выдача займов без поручителей, залога, скрытых комиссий и платежей. При погашении займов клиенту также предлагается несколько вариантов.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1565', ' 													 - 											', '150,00 - 170,00', '13 454.15', '13 358.28', 2, NULL, '2013-12-04 16:36:51'),
(1575, 'Rusonyx', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/rusonyx_1575.5.htm', 'Услуги', 0, 'Компания Rusonyx&nbsp; - это один из самых продвинутых провайдеров хостинга в России. Rusonyx готова предложить своим клиентам услуги по регистрации доменов, выделенного VPS хостинга, виртуального хостинга и аренде серверов, а также регистрации и выдаче IP-адресов.\r\n	Вся деятельность подтверждена лицензией на предоставление телематических услуг, выданной Министерством&nbsp; РФ по связи и информатизации, а при работе используются только современные и передовые технологии.\r\n	Партнеры Rusonyx &ndash; надежные компании, достигшие высоких результатов в области программирования, веб-дизайна и разработок флэш-анимации.\r\n	Несмотря на то, что главный офис компании располагается в Москве, большинство клиентов Rusonyx находятся и обслуживаются в регионах, куда направлены все основные', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1575', ' 													 - 											', '20,00%', '0.00', '0.00', 23, NULL, '2013-12-04 16:36:51'),
(1605, 'Инфопродукты: Похудение 25 кадр', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_pohudenie_kadr_1605.5.htm', 'Инфопродукты', 0, 'Похудение 25 кадр поможет легко и быстро избавиться от лишнего веса, не прибегая к изнурительным тренировкам и не ограничивая себя в еде!\r\n	Благодаря современным технологиям и действию 25-го кадра, заложенного в программу, снижение веса будет происходить автоматически, и за 3 месяца ежедневного использования программы вы гарантированно потеряете 15 кг и больше. Главным принципом работы программы является кодовая информация, которая программирует организм к потере веса раз и навсегда.\r\n	Эффективность программы доказана положительными отзывами и итоговыми результатами пользователей.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1605', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:52'),
(1625, 'Alba', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/alba_1625.5.htm', 'Подарки, сувениры, цветы, Одежда и обувь', 0, 'Интернет-магазин Alba &ndash; это широкий ассортимент мужской и женской обуви, а также аксессуаров от таких известных производителей как ALBA, SVETSKi и DUMOND.\r\n	Товары произведены только из натуральных материалов, отвечают всем стандартам качества и реализуются по доступным для покупателей ценам.\r\n	Удобные способы оплаты и доставки в любой регион России, постоянно обновляющийся ассортимент, а также сезонные распродажи и скидки делают покупки в магазине Alba приятными и успешными!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1625', ' 													 - 											', '13,00%', '0.00', '0.00', 147, NULL, '2013-12-04 16:36:52'),
(1635, 'Инфопродукты: Стоп варикоз', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_stop_varikoz_1635.5.htm', 'Инфопродукты', 0, 'Стоп варикоз предлагает воспользоваться курсом &laquo;Персональный флеболог: 100% гарантия победы над варикозом&raquo;, который поможет в течение короткого срока избавиться от варикозного расширения вен.\r\n	Теперь не нужно платить огромные деньги на консультации врачей, сложные операции и другие хирургические вмешательства, а также не всегда действующие медикаменты, потому что с помощью данного курса вы сможете побороть варикоз в разы дешевле и эффективнее всех перечисленных средств.\r\n	Все, что нужно &ndash; понять природу заболевания и найти правильную стратегию ее лечения. Именно эту методику и целостную систему лечения вы найдете на диске &laquo;Персональный флеболог: 100% гарантия победы над варикозом&raquo;.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1635', ' 													 - 											', '700,00', '0.00', '1 629.84', 24, NULL, '2013-12-04 16:36:52'),
(1645, 'Инфопродукты: Как свести с ума мужчину', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_kak_svesti_s_uma_muzhchinu_1645.5.htm', 'Инфопродукты', 0, 'Как свести мужчину с ума &ndash; практический курс комплексных упражнений, который направлен на устранение сексуальных проблем у женщин.\r\n	Всего за 4 недели курса &laquo;Искусство вумбилдинга&raquo; вы узнаете о своем теле абсолютно все и и сможете найти тот самый заветный ключ к сердцу любого мужчины.\r\n	Ежедневно и последовательно выполняя необходимые упражнения, следуя описаниям и соблюдая каждый пункт вы гарантированно достигнете поразительных результатов.\r\n	Кроме того, комплекс имеет такие &laquo;побочные эффекты&raquo; как антицеллюлитный эффект, стабильзации гормонального фона, нормализации кровообращения и другие приятные бонусы для жизни, полной сексуальной энергии!\r\n	Многие пары уже подтвердили действие чудо-тренинга на собственном опыте.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1645', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:52'),
(1675, 'Star Conflict', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/star_conflict_1675.5.htm', 'Онлайн-игры', 0, 'Star Conflict &ndash; бесплатная клиентская онлайн-игра в жанре космического экшена.\r\n	Игроку предстоит присоединиться к одной из 3-х фракций и отправиться в открытый космос на поиски артефактов, которые были разбросаны по всей Галактике после разрушения великой цивилизации Предтеч.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1675', ' 													 - 											', '15,00 - 50,00', '5 528.67', '5 017.34', 1, NULL, '2013-12-04 16:36:52'),
(1695, 'My Lands - 3', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/my_lands_1695.5.htm', 'Онлайн-игры', 1, 'My Lands - браузерная онлайн-стратегия с возможностью вывода игровых денег в реальные. Эта MMORPG не требует установки на компьютер &ndash; достаточно выйти в интернет с любого браузера и начать игру. Графика этой военно-экономической стратегии в реальном времени вдохновлена Heroes of Might and Magic, а сама игра признана &laquo;Лучшей браузерной игрой 2010 года&raquo; по мнению ConfOg. Четыре классические расы на выбор: эльфы, дроу (темные эльфы), рыцари и демоны позволяют определенные бонусы в игре, а битва 2 фракций &ndash; Темной (дроу и демоны) и Светлой (рыцари и эльфы) &ndash; делают игру интереснее.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1695', ' 													5,00											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:52');
INSERT INTO `offers` (`id`, `name`, `offerlink`, `category`, `locked`, `description`, `bannerlink`, `cpl`, `cpa`, `epc7d`, `epc90d`, `category_id`, `created_at`, `updated_at`) VALUES
(1755, 'Образование: Moscow Business School', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/obrazovanie_moscow_business_school_1755.5.htm', 'Услуги', 1, 'Moscow Business School является одним из ведущих образовательных центров в России, где проходят обучение сотрудники лидирующих компаний российского и западного рынка.\r\n	В преподавательский состав входят интересные и высокопрофессиональные люди, готовые предоставить учащимся теоретический и практический материал, делая процесс обучение легким и продуктивным.\r\n	Помимо индивидуального обучения, MBA проводит корпоративные курсы по любым направлениям.\r\n	Полезное и практичное приложение от MBA для всех пользователей &ndash; iBooks, которое позволит использовать фото- и видеоматериалы, проходить&nbsp; различные тесты, находить необходимые учебные материалы и делать пометки на полях учебников.\r\n	Филиалы MBA расположены в крупнейших регионах России, странах СНГ, Великобритании, Германии, Чехии и США.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1755', ' 													 - 											', '2''037,50', '0.00', '0.00', 23, NULL, '2013-12-04 16:36:52'),
(1785, 'Промсвязьбанк', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/promsvyazbank_1785.5.htm', 'Финансы и Банки', 0, 'Промсвязьбанк &ndash; это универсальный банк, который предоставляет полный комплекс услуг по финансовому обслуживанию физическим и юридическим лицам.\r\n	За время работы банку было присвоено множество высоких рейтингов от мировых рейтинговых агентств, а также он входит в 10-ку ведущих банков России 500 крупнейших мировых банков.\r\n	Главными преимуществами банка являются такие факторы как высокая надежность, оперативные расчеты, минимум документации, гибкие тарифы, быстрое открытие счета, поддержка аналитиков, отсутствие абонентской платы за ведение счета, а также скидки всем клиентам, работающим с банком более полугода.\r\n	Клиентская база Промсвязьбанка насчитывает более 93 000 российских предприятий, более 400 000 вкладчиков и заемщиков и более&nbsp; 1 млн. держателей банковских карт. В региональную сеть входят 250 точек продаж в крупных городах России, представительства в Китае, Индии и на Украине и филиал на Кипре.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1785', ' 													 - 											', '1''000,00 - 4''100,00', '0.00', '10 673.84', 2, NULL, '2013-12-04 16:36:52'),
(1845, 'Lost Sector', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/lost_sector_1845.5.htm', 'Онлайн-игры', 1, 'Lost Sector &ndash; бесплатная клиентская онлайн-игра в стратегическом жанре.\r\n	В ходе поисков редкого ресурса &laquo;Ребис&raquo;, способного продлевать человеческую жизнь и делать из него мощную боевую машину путем внедрения в тело специальных имплантантов, на планете началась жестокая война, которая уничтожила все цивилизации.\r\n	Позже выжившее человечество возродило мир, продолжив поиски и разработки ресурса. Они разделились на фракции, которые продолжили вражду между собой.\r\n	Вам предстоит выбрать свою фракцию и принять участие в борьбе за контроль по производству &laquo;Ребиса&raquo;, выполнении интересных миссий и заданий.\r\n	Бои проходят в пошаговом режиме, и результат зависит только от вас и вашей правильно выбранной стратегии.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1845', ' 													12,00											', '-', '2 300.95', '1 917.46', 1, NULL, '2013-12-04 16:36:52'),
(1855, 'Skinon (RU)', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/skinon_1855.5.htm', 'Компьютеры, Телефоны', 0, 'SkinOn.ru - один из лидеров на российском рынке персонализации гаджетов. Собственное производство в Москве, call-центр без выходных, быстрая доставка, гарантии качества продукта, большой выбор промо-материалов, отдельные landing page под виды товаров и разные модели устройств.\r\n	На Skinon.ru представлено более 2000 дизайнов, которые позволят оформить гаджет в соответствии с любыми вкусами и пожеланиями. Кроме того, есть возможность создать свой дизайн на телефон или другое устройство с помощью &quot;Конструктора товаров&quot;.\r\n	Наклейки выполнены из высококачественных материалов фирмы 3М.\r\n	Чехлы изготовлены из высококачественного поликарбоната и имеют покрытие soft touch.\r\n	Чехлы и виниловые наклейки &ndash; на сегодняшний день самый доступный и эффектный способ для кардинального преображения девайса!\r\n	Вебмастер может запросить любой промо-материал и изготовление посадочных страниц под свой трафик, написав запрос на marketing@skinon.ru.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1855', ' 													 - 											', '156,00', '3 962.74', '2 748.35', 26, NULL, '2013-12-04 16:36:52'),
(1865, 'Castlot', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/castlot_1865.5.htm', 'Онлайн-игры', 1, 'Castlot &ndash; это бесплатная браузерная онлайн-игра в фэнтезийном стиле, действие которой происходит в период средневековой Англии, где идет кровавая и беспощадная война между Саксонскими захватчиками и королем Артуром.\r\n	Игрок выбирает свою сторону - фракцию Света или фракцию Тьмы, -&nbsp; и получает в свое пользование пустое королевство, развитие которого требует добычу полезных ресурсов, а также строительство зданий для мирного народа и армии.\r\n	В течении игры вам предстоит сделать из своего королевства огромную империю, завоевывать земли, участвовать в битвах с другими фракциями и выполнять интересные задания и квесты.\r\n	Для того чтобы попасть в мир, полный приключений и военных действий, достаточно пройти быструю регистрацию на сайте игры.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1865', ' 													 - 											', '12,00 - 46,00', '5 241.05', '4 250.36', 1, NULL, '2013-12-04 16:36:52'),
(1875, 'Инфопродукты: Как забеременеть', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_kak_zaberemenet_1875.5.htm', 'Инфопродукты', 0, 'Книга &laquo;Чудо беременности&raquo; - это простой и безопасный способ зачать долгожданного ребенка, устранить все гормональные нарушения, улучшить свою сексуальную жизнь и обрести семейные гармонию и умиротворенность.\r\n	С помощью описанных в книге упражнений и советов, вы сможете в самые короткие сроки&nbsp;\r\n	Теперь не нужно прибегать к медикаментам, хирургическому вмешательству и искусственному оплодотворению и другим не всегда полезным средствам!\r\n	Сотни женщин уже доказали эффективность данной программы, родив здоровых, сильных и крепких малышей.\r\n	При заказе книги все клиентки получают несколько приятных бонусов совершенно бесплатно!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1875', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:52'),
(1885, 'Инфопродукты: Нет очкам', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_net_ochkam_1885.5.htm', 'Инфопродукты', 0, 'Для того чтобы восстановить зрение на 100%, теперь не нужно прибегать к хирургическим вмешательствам, ведь для этого есть специализированный диск &laquo;Верни свое идеальное зрение&raquo;, который состоит из комплекса упражнений для ваших глаз.\r\n	С помощью простых упражнений на фокусирование зрения, развитие глазных мышц и повышение их тонуса, уже через несколько недель вы увидите невероятный результат! Всего 10-15 минут упражнений в день помогут вам навсегда забыть про очки и линзы.\r\n	Проходить курс &laquo;Верни свое идеальное зрение&raquo; можно всей семьей.\r\n	Заказывая диск, вы экономите время, деньги и нервы!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1885', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:52'),
(1895, 'Инфопродукты: До колена', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_do_kolena_1895.5.htm', 'Инфопродукты', 0, 'Программа &laquo;Доколена.ру&raquo; - это то, что нужно мужчинам, желающим увеличить свой половой орган и вернуть уверенность в себе и в свои силы.\r\n	В курс входит&nbsp; комплекс необходимых, а, главное, эффективных упражнений, дающих в итоге 100% результат!\r\n	Следуя всем пунктам, вы сможете избавиться от комплекса неполноценности, увеличить эрекцию и длительность полового акта, повысить сексуальную выносливость, а также усилить ощущения во время секса. Курс &laquo;Доколена.ру&raquo; является лауреатом выставки &laquo;Информационные продукты для мужчин в области здоровья&raquo;, что говорит о качестве данного курса.\r\n	При заказе диска гарантируется 4 приятных бонуса в подарок, а также полная анонимность.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1895', ' 													 - 											', '700,00', '0.00', '3 259.68', 24, NULL, '2013-12-04 16:36:52'),
(1905, 'Инфопродукты: Рост груди', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_rost_grudi_1905.5.htm', 'Инфопродукты', 0, 'Увеличение груди без сложных болезненных операций, таблеток и препаратов &ndash; это реально!\r\n	Программа &laquo;Быстрый рост груди: методика и рекомендации&raquo; предоставляет исчерпывающую информацию о правильных и эффективных тренировках по увеличению груди, это пошаговая инструкция для достижения превосходного результата и его поддержания на долгое время!\r\n	Методика абсолютно безвредна и подходит женщинам любого возраста, комплекции и особенностей организма.\r\n	Для отличного результата достаточно уделять всего 15 минут в день!\r\n	При покупке курса все клиентки получают в подарок любую электронную книгу, представленную на сайте.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1905', ' 													 - 											', '700,00', '0.00', '17 896.26', 24, NULL, '2013-12-04 16:36:52'),
(1915, 'Инфопродукты: Идеальный пресс', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_idealnyiy_press_1915.5.htm', 'Инфопродукты', 0, 'Хотите иметь идеальный пресс, но нет времени заниматься спортом?\r\n	Тогда это предложение для вас! Уникальный пояс Ab Belt предлагает самый быстрый, простой и эффективный способ восстановить мышцы живота, сделать их более упругими и подтянутыми, а фигуру &ndash; стройной и здоровой.\r\n	Ab Belt состоит из 3 пар электродных накладок, позволяющих одновременно тренировать мышцы брюшного пресса, спины и талии, что заменяет полноценную тренировку в спортивном зале и экономит ваше время.\r\n	Продукт клинически протестирован и имеет всю необходимую документацию и сертификаты.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1915', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:52'),
(1925, 'War Thunder', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/war_thunder_1925.5.htm', 'Онлайн-игры', 1, 'War Thunder &ndash; клиентская онлайн-игра, которая перенесет вас во времена Второй мировой войны.\r\n	Игроку предстоит стать одним из многочисленных участников исторических сражений на воде, земле и в воздухе.\r\n	Огромное внимание разработчики уделили графике и внешнему виду техники, продуманному&nbsp; до мельчайших деталей, а также развитию персонажа и его возможностям.\r\n	Вы можете стать героем-одиночкой или собрать свою армию против других реальных игроков со всего мира.\r\n	Участвуйте в жестоких битвах, выполненных в PvP-режиме, проходите миссии и побеждайте!\r\n	Игра придется по вкусу как начинающим игрокам, так опытным профи.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1925', ' 													 - 											', '40,00 - 150,00', '5 241.05', '5 432.79', 1, NULL, '2013-12-04 16:36:52'),
(1995, 'Ютинет.ру', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/yutinet_ru_1995.5.htm', 'Спортивные товары, Товары для строительства и ремонта, Компьютеры, Электроника и Фото, Телефоны, Одежда и обувь, Бытовая техника', 0, 'Начав свою деятельность в 2004 году, на сегодняшний день интернет-магазин электроники Ютинет.ру является лидером на рынке реализации и ассортименту электроники и бытовой техники в России.\r\n	Квалифицированные специалисты и консультанты обрабатывают более тысячи заказов ежедневно в круглосуточном режиме и предлагают покупателям лучшие товары по лучшим и выгодным ценам. Еще одна удобная функция &ndash; оповещение о состоянии заказа смс-сообщением\r\n	Ютинет.ру любит своих клиентов, поощряет их и проводит различные конкурсы и акции с интересными призами и бонусами.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=1995', ' 													 - 											', '365,00', '19 781.76', '7 382.21', 27, NULL, '2013-12-04 16:36:52'),
(2015, 'Фабрика Окон', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/fabrika_okon_2015.5.htm', 'Товары для дома и дачи', 0, 'Компания Фабрика окон занимается производством и продажей пластиковых окон, окон ПВХ и фурнитуры для квартир и коттеджей, созданием сложных конструкций в виде витражей, остекления зимних садов, отделки балконов и лоджий по выгодным и доступным каждому ценам, а также предоставляет услуги по клинингу помещений и разработке дизайн-проектов в своем архитектурном бюро.\r\n	Имея собственные и высокотехнологичные производственные заводы, на данный момент Фабрика окон является лидером на рынке по производству окон и фурнитуры, оказывая все услуги в соответствии с законодательством РФ и подтверждает качество своей продукции всеми необходимыми сертификатами.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2015', ' 													 - 											', '1''200,00', '0.00', '0.00', 11, NULL, '2013-12-04 16:36:52'),
(2035, 'Butik.ru', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/butik_ru_2035.5.htm', 'Одежда и обувь', 1, 'Butik.ru &ndash; интернет-магазин модной одежды, обуви и аксессуаров для мужчин и женщин. Здесь покупатель найдет огромный выбор ярких и стильных коллекций от известных и ведущих мировых брендов на любой вкус.\r\n	Совершать покупки можно как через интернет, так и в магазине, который находится в центре Москвы, где клиент может посмотреть, примерить товар и сразу же приобрести его.\r\n	Клубная система магазина Butik.ru позволяет покупателям получать приятные бонусы и значительные скидки на все товары.\r\n	Butik.ru &ndash; это только оригинальная продукция, никаких копий или подделок!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2035', ' 													230,00											', '-', '10 450.14', '7 573.95', 5, NULL, '2013-12-04 16:36:53'),
(2095, 'Carnage 2009', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/carnage_2095.5.htm', 'Онлайн-игры', 1, '', '', ' 													 - 											', '38,00 - 308,00', '8 596.60', '3 547.29', 1, NULL, '2013-12-04 16:36:53'),
(2100, 'Инфопродукты: Увеличение губ', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_uvelichenie_gub_2100.5.htm', 'Инфопродукты', 0, 'Инфопродукты: Увеличение губ предлагает женщинам уникальную возможность увеличить губы естественным путем. Теперь не нужно использовать тонны косметики, прибегать к хирургическому вмешательству или закачивать ботэкс для достижения красивых и привлекательных губ: для этого есть вакуумный тренажер Sexy Lips от ведущего американского косметолога Синтии Роланд, которая совершила настоящую революцию в мире красоты и здоровья женщин.\r\n	Всего несколько минут в день, и результат не заставит себя ждать! Уже при первом применении объем ваших губ увеличится на 50% !\r\n	Sexy Lips &ndash; отличный и безопасный способ выглядеть моложе и ловить на себя восхищенные взгляды мужчин.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2100', ' 													 - 											', '1''000,00', '0.00', '61 614.26', 24, NULL, '2013-12-04 16:36:53'),
(2106, 'Инфопродукты: Без пластики', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_bez_plastiki_2106.5.htm', 'Инфопродукты', 0, 'Программа &laquo;Супер молодость&raquo;, разработанная Маргаритой Павленко, поможет женщинам выглядеть на 15 лет моложе уже через две недели! Не нужно прибегать к радикальным мерам и ложиться под нож хирурга, а потом жалеть о последствиях, принимать сомнительные препараты и тратить на это огромные деньги, посещать дорогостоящие салоны красоты и тренажерные залы.\r\n	Все, что необходимо &ndash; строго следовать всем инструкциям, указанным в руководстве курса, и результат не заставит себя ждать.\r\n	Эффективность методики омоложения доказана не только научной стороной, но и многочисленными положительными отзывами женщин.\r\n	Остановите время и продлите свою молодость!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2106', ' 													 - 											', '1''000,00', '0.00', '4 537.98', 24, NULL, '2013-12-04 16:36:53'),
(2107, 'World of Dragons', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/world_of_dragons_2107.5.htm', 'Онлайн-игры', 0, 'World of Dragons &ndash; это бесплатная клиентская 3D онлайн-игра в жанре RPG, главной темой которой являются воздушные сражения на Драконах.\r\n	На ваш выбор &ndash; две воюющие между собой фракции, за одну из которых вам и придется начать игру. Ваш главный друг &ndash; Божественный Дракон, чьи навыки необходимо развивать. Вместе вам предстоит выполнять различные задания и миссии, приобретая ценный опыт и важные предметы.&nbsp;\r\n	Бои проходят по системе PvP и их исход зависит только от ваших навыков, умений и приобретенного во время игры опыта. Особенность игры - &laquo;Состояние берсерка&raquo;, при котором в битве персонаж получает неограниченные возможности и силы для уничтожения большого количества врагов.\r\n	Помимо сражений вы можете выбрать&nbsp; мирный путь &ndash; освоить понравившееся ремесло или профессию, что очень поможет вам в прохождении.\r\n	World of Dragons &ndash; это волшебный и красочный мир, открывающий массу возможностей!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2107', ' 													 - 											', '60,00 - 150,00', '4 889.51', '4 410.15', 1, NULL, '2013-12-04 16:36:53'),
(2109, 'Детский мир', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/detskiy_mir_2109.5.htm', 'Одежда и обувь, Товары для детей', 0, 'Интернет-магазин Детский Мир - это широкий ассортимент товаров для детей любого возраста от известных российских и зарубежных брендов.\r\n	Каталог продукции наполнен самыми необходимыми для развития и ухода за малышами товарами: различные игрушки и развивающие игры, коляски, велосипеды, детская мебель, товары для новорожденных и многое другое по выгодным и доступным для родителей ценам.\r\n	Товары сертифицированы, имеют необходимые документы и отвечают всем стандартам качества.\r\n	Детский Мир &ndash; место, которое подарит детям яркие эмоции и улыбки!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2109', ' 													 - 											', '325,00', '0.00', '0.00', 22, NULL, '2013-12-04 16:36:53'),
(2120, 'Инфопродукты: Новый Кузов', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_novyiy_kuzov_2120.5.htm', 'Инфопродукты, Товары для авто- и мототехники', 0, 'Для того чтобы избавится от мелких царапин и повреждений на вашей машине теперь не нужно обращаться в автосалоны, тратить свое время и деньги, ведь для этого есть новое выгодное решение &ndash; карандаш Fix it Pro!\r\n	Использовать Fix it Pro проще простого &ndash; нужно просто встряхнуть карандаш, открыть колпачок и наполнить стержень-аппликатор корректирующей жидкостью! В состав входит секретная формула геля, имеющая единую структуру с верхним слоем лакокрасочного покрытия автомобиля. Жидкость равномерно заполняет участок с повреждением и устраняет его в считанные минуты.\r\n	Fix it Pro &ndash; революционное средство для борьбы с царапинами на вашем автомобиле!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2120', ' 													 - 											', '650,00', '0.00', '0.00', 28, NULL, '2013-12-04 16:36:53'),
(2121, 'Инфопродукты: Белоснежная улыбка', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_belosnezhnaya_ulyibka_2121.5.htm', 'Инфопродукты', 0, 'Система White Light предлагает инновационный способ отбеливания зубов в домашних условиях, разработанный ведущими стоматологами, эффективность которого подтверждена научными исследованиями и тестированиями.\r\n	В состав препарата входит специальный гель, который равномерно распределяется по зубной эмали, попадая во все труднодоступные участки, а излучающая лампа усиливает процесс отбеливания.\r\n	Вам больше не придется тратить огромные деньги на прием стоматолога, ведь препаратом можно пользоваться в любое удобное для вас время и по выгодной цене!\r\n	Препарат White Light не имеет противопоказаний, не вызывает никаких побочных эффектов и является абсолютно безопасном продуктом.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2121', ' 													 - 											', '650,00', '0.00', '2 716.40', 24, NULL, '2013-12-04 16:36:53'),
(2122, 'Инфопродукты: Женский гипноз', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_zhenskiy_gipnoz_2122.5.htm', 'Инфопродукты', 0, 'Женщины! Вы хотите, чтобы мужчины выполняли любые ваши желания и прихоти, любили вас и, главное, уважали? Чтобы ваши завистницы и враги навсегда исчезли? Чтобы вы стали по-настоящему сильной личностью? Тогда курс &laquo;Woman - гипноз ― ключ к абсолютной власти над людьми!&raquo; - это то, что необходимо для вас!\r\n	Всего неделя обучения, и вы получите все необходимые знания по управлению людьми с помощью гипноза. Программа дает 100% результат и абсолютно безопасна в психологическом плане. Никто даже и не заметит, что силой своей мысли вы отдаете приказы, и ваши просьбы незамедлительно выполняются.\r\n	При заказе курса &laquo;Woman - гипноз ― ключ к абсолютной власти над людьми!&raquo; всех покупателей ждут приятные бонусы!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2122', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:53'),
(2126, 'INKSYSTEM', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/inksystem_2126.5.htm', 'Компьютеры', 0, 'INKSYSTEM &ndash; интернет-магазин, осуществляющий продажу оригинальных систем непрерывной подачи чернил, перезаправляемых картриджей, чернил и фотобумаги для печатных устройств таких производителей как Canon, Epson, Brother и HP.\r\n	Магазин постоянно расширяет свой ассортимент, предлагая своим покупателям лучшие товары, качество которых подтверждено необходимыми сертификатами.\r\n	Каждый клиент может воспользоваться специальными условиями и скидками, а также &laquo;Дисконтной картой&raquo;, дающей 5% скидку на всю продукцию со второй покупки.\r\n	Здесь вы найдете все, что необходимо для качественной печати по доступным и приемлемым ценам!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2126', ' 													 - 											', '800,00', '3 515.34', '6 295.65', 29, NULL, '2013-12-04 16:36:53'),
(2129, 'Dostavka.ru (RU)', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/dostavka_ru_2129.5.htm', 'Телефоны, Электроника и Фото, Бытовая техника, Компьютеры, Товары для строительства и ремонта, Товары для детей, Спортивные товары, Товары для красоты и здоровья, Одежда и обувь, Оборудование', 0, 'Интернет-магазин Dostavka.ru является одним из крупнейших мультимаркетов, где клиенты могут приобрести товары различных категорий с доставкой на дом и в офис. Это компьютерная техника, парфюмерия, инструменты, детские принадлежности и другие необходимые для жизни и работы товары.\r\n	Dostavka.ru также предлагает своим покупателям интересные статьи и советы, новости, отзывы и обзоры продукции, которые можно обсудить на форуме интернет-магазина, получить за это бонусные баллы и возможность выиграть полезные призы.\r\n	Доставка товара производиться на следующий день после заказа.\r\n	Dostavka.ru &ndash; это отличный сервис, доступные цены, надежная гарантия и множество приятных сюрпризов!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2129', ' 													 - 											', '3,00% - 4,20%', '0.00', '14 412.88', 30, NULL, '2013-12-04 16:36:53'),
(2131, 'Monster Online', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/monster_online_2131.5.htm', 'Электроника и Фото, Телефоны, Компьютеры', 1, 'Monster Online &ndash; интернет-магазин популярных и стильных наушников фирмы Monster Beats.\r\n	Вы можете приобрести оригинальные наушники Monster Beats по приемлемым ценам, качество которых подтверждено всеми необходимыми документами и сертификатами.\r\n	Оплата заказов осуществляется в рублях после доставки курьером. Также вы легко сможете примерить покупку или обменять на другую модель, если заказанная по каким-то причинам не подошла.\r\n	Помимо розничной торговли, Monster Online заинтересован в сотрудничестве с оптовыми клиентами.\r\n	Ассортимент продукции постоянно дополняется и расширяется!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2131', ' 													260,00											', '-', '3 771.00', '3 994.70', 31, NULL, '2013-12-04 16:36:53'),
(2142, 'Инфопродукты: Стоп целлюлит', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_stop_tsellyulit_2142.5.htm', 'Инфопродукты', 0, 'Методика &laquo;Стоп целлюлит&raquo; поможет всем женщинам навсегда избавиться от целлюлита, вновь почувствовать себя красивой и избавиться от комплексов! Следуя всем инструкциям и упражнениям, указанным в курсе, вы сможете быстро достичь непревзойденных результатов в домашних условиях.\r\n	Вам больше не нужно тратить деньги на различные лекарственные препараты, а также прибегать к хирургическому вмешательству, ведь единственное, что вам нужно &ndash; это курс &laquo;Стоп целлюлит&raquo;.\r\n	Эффективность методики доказана позитивными отзывами тысячи женщин!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2142', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:53'),
(2152, 'Домашние деньги: Займы', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/domashnie_dengi_zaymyi_2152.5.htm', 'Финансы и Банки', 0, 'Микрофинансовая организация &laquo;Домашние Деньги&raquo; &ndash; компания №1 на российском рынке микрофинансирования, специализируется на выдаче микрозаймов населению на дому через сеть агентов. Компания &laquo;Домашние Деньги&raquo; входит в группу компаний ADELA FINANCIAL RETAIL GROUP. Другими участниками холдинга являются: микрофинансовая организация &laquo;Финотдел&raquo;, предоставляющая микрозаймы юридическим лицам представителям малого бизнеса, кредитный брокер &laquo;Фосборн Хоум&raquo; и коллекторское Агентство &laquo;Секвойя кредит консолидейшн&raquo;.\r\n	На сегодняшний день у компании &laquo;Домашние Деньги&raquo; более 60 000 клиентов, в компании работает более 1 500 человек, 85% которых непосредственно контактируют с клиентами.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2152', ' 													 - 											', '95,00 - 150,00', '7 765.70', '3 739.04', 2, NULL, '2013-12-04 16:36:53'),
(2157, 'Atlas for Men', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/atlas_for_men_2157.5.htm', 'Одежда и обувь', 0, 'Atlas for Men &ndash; интернет-магазин мужской и женской одежды, обуви и аксессуаров для активного образа жизни, отдыха на природе, путешествий и занятий спортом.\r\n	На страницах электронного каталога вы найдете огромные коллекции оригинальной спортивной одежды любого размера по приемлемым и доступным ценам.\r\n	Товары произведены из натуральных и теплых материалов, а также прошли все испытания на практичность и качество, что является одними из главных критериев покупки такого рода одежды.\r\n	Для дам представлена широкая линейка женственных моделей: свитера, кружевные топы, туники и домашней одежды: халаты, кимоно, пижамы.\r\n	Магазин Atlas for Men &ndash; это территория удобства и качества!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2157', ' 													 - 											', '538,00', '0.00', '10 066.65', 5, NULL, '2013-12-04 16:36:53'),
(2169, 'Инфопродукты: Набор для педикюра', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_nabor_dlya_pedikyura_2169.5.htm', 'Инфопродукты', 0, 'Набор для педикюра PEDISPA за считанные минуты сделает ваши ножки красивыми и ухоженными!\r\n	Набор состоит из двух вращающихся насадок: в виде перфорированного круга для удаления мазолей, натоптышей и ороговевшей кожи и в виде диска с уникальным зернистым покрытием для того, чтобы сделать обработанную кожу нежной и гладкой.\r\n	Препарат работает на батарейках, удобен и прост в применении, не занимает много места и будет всегда под рукой дома, на отдыхе в деловых поездках.\r\n	PEDISPA невозможно купить в магазинах, поэтому спешите сделать заказ на официальном сайте!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2169', ' 													 - 											', '650,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:53'),
(2173, 'SmartDengi', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/smartdengi_2173.5.htm', 'Финансы и Банки', 1, 'SmartDengi является торговой компанией и профессиональной платформой по быстрым и эффективным заработкам на лидирующих финансовых рынках.\r\n	Своим клиентам компания предлагает хорошие и выгодные условия торговли без предварительной подготовки, фиксированные процентные ставки, а также возможность торговать и заключать сделки по всему миру.\r\n	SmartDengi &ndash; это компания с мировым опытом, надежными партнерами, европейским сервисом и индивидуальным подходом к каждому клиенту.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2173', ' 													 - 											', '350,00', '0.00', '13 390.24', 2, NULL, '2013-12-04 16:36:53'),
(2174, 'Metal War Online', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/metal_war_online_2174.5.htm', 'Онлайн-игры', 1, 'Metal War Online - клиентская сессионная MMO-игра в Sci-Fi сеттинге, действие которой происходит в ближайшем будущем, где идет противостояние двух крупных корпораций, воюющих за месторождение невиданных и редких ресурсов.\r\n	Сражения проходят на отдельных аренах, где игроку предстоит использовать все свои стратегические и боевые навыки для уничтожения врагов и получения опыта.\r\n	Особенностями игры огромное разнообразие военных машин, которые делятся на 4 класса (штурмовики, артиллерия, поддержка и разведчики), а также выполненный в футуристическом стиле геймлей.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2174', ' 													 - 											', '19,00', '3 035.97', '2 428.78', 1, NULL, '2013-12-04 16:36:53'),
(2185, 'Все майки', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/vse_mayki_2185.5.htm', 'Одежда и обувь', 1, 'Интернет-магазин &laquo;Все майки&raquo; предлагает покупателям широкий выбор стильных маек, футболок, толстовок,&nbsp; а также кружек и других аксессуаров на любой вкус и по любому случаю жизни.\r\n	Клиент может быстро и легко заказать себе индивидуальную футболку со своим изображением или надписью по доступной цене или выбрать товар, уже имеющийся в наличии.\r\n	Весь товар произведен из экологически чистых материалов и прошел необходимые проверки по качеству.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2185', ' 													 - 											', '250,00', '1 661.80', '4 442.11', 5, NULL, '2013-12-04 16:36:54'),
(2187, 'Домашние деньги-2: Займы', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/domashnie_dengi_zaymyi_2187.5.htm', 'Финансы и Банки', 0, 'Микрофинансовая организация &laquo;Домашние Деньги&raquo; &ndash; компания №1 на российском рынке микрофинансирования, специализируется на выдаче микрозаймов населению на дому через сеть агентов. Компания &laquo;Домашние Деньги&raquo; входит в группу компаний ADELA FINANCIAL RETAIL GROUP. Другими участниками холдинга являются: микрофинансовая организация &laquo;Финотдел&raquo;, предоставляющая микрозаймы юридическим лицам представителям малого бизнеса, кредитный брокер &laquo;Фосборн Хоум&raquo; и коллекторское Агентство &laquo;Секвойя кредит консолидейшн&raquo;.\r\n	На сегодняшний день у компании &laquo;Домашние Деньги&raquo; более 60 000 клиентов, в компании работает более 1 500 человек, 85% которых непосредственно контактируют с клиентами.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2187', ' 													 - 											', '700,00', '6 103.90', '6 071.94', 2, NULL, '2013-12-04 16:36:54');
INSERT INTO `offers` (`id`, `name`, `offerlink`, `category`, `locked`, `description`, `bannerlink`, `cpl`, `cpa`, `epc7d`, `epc90d`, `category_id`, `created_at`, `updated_at`) VALUES
(2189, 'Банк Русский Стандарт Украина: Кредитные карты', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_russkiy_standart_ukraina_kreditnyie_kartyi_2189.5.htm', 'Финансы и Банки', 1, 'Несмотря на короткий срок присутствия на территории Украины, на сегодняшний день банк Русский Стандарт зарекомендовал себя не только как надежный партнер, предлагающий весь спектр банковских услуг физическим и юридическим лицам, но и стал одним из крупнейших финансовых предприятий.\r\n	Банк Русский Стандарт постоянно развивается, улучшает свой сервис, вводит новые технологические возможности, сервисы, а также продукты по кредитным картам, кредитам, займам и депозитам.&nbsp; Крупнейшие торговые сети страны уже успешно заключили сотрудничество с банком Русский Стандарт.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2189', ' 													 - 											', '75,00', '68 261.44', '24 639.31', 2, NULL, '2013-12-04 16:36:54'),
(2194, 'Stars Draft', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/stars_draft_2194.5.htm', 'Досуг и развлечения', 1, 'StarsDraft &ndash; первая на территории СНГ и Евросоюза компания по коммерческому фэнтези-футболу, предлагающая большое разнообразие турниров, матчей и акций в онлайн-режиме.\r\n	Все новые участники могут участвовать в неделе турниров с возможностью выиграть реальные денежные призы и другие дополнительные призы.\r\n	Оплата ставок производиться через KIWI-Кошелек, сервисы PayPal и WebMoney, а также переводом по банковским картам.\r\n	Регистрироваться в проекте и принимать участие в турнирах разрешено только совершеннолетним лицам.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2194', ' 													15,00											', '-', '0.00', '0.00', 32, NULL, '2013-12-04 16:36:54'),
(2197, 'Blood and Soul - 2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/blood_and_soul_2197.5.htm', 'Онлайн-игры', 0, 'Blood and Soul &mdash; это ролевая онлайн игра в стиле романтического фентези.\r\n	Игроку предстоит не только участвовать в боях на аренах против вражеских гильдий, но и признаваться в любви и даже проводить свадьбы. В игре очень продуманная система эмоций, что придает персонажу индивидуальный характер и позволяет по максимуму оживить его.\r\n	Также здесь действует система игровых питомцев - Божественные помощники в виде Эльфов всегда на стороне игрока, они растут и развиваются вместе с ним, получая опыт в сражениях.\r\n	Компания-разработчик ежедневно предоставляет игрокам приятные сюрпризы и подарки.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2197', ' 													 - 											', '7,00% - 27,00%', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:54'),
(2203, 'Rising Cities', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/rising_cities_2203.5.htm', 'Онлайн-игры', 1, 'Rising Cities &ndash; новая браузерная онлайн-игра, в жанре экономической стратегии. Построй свой необыкновенный мегаполис, развивай свой бизнес, улучшай экономику своего города, развивай различные области инфраструктуры. Сделай город самым прибыльным, красивым и развитым. У тебя есть замечательная возможность выстраивать экономические отношения с другими игроками, а так же узнать, кто из вас лучший архитектор.\r\n	\r\n	Официальный сайт: http://www.risingcities.ru', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2203', ' 													0,43 - 3,02											', '6,48 - 30,23', '3 483.38', '2 556.61', 1, NULL, '2013-12-04 16:36:54'),
(2206, 'Инфопродукты: Сквирт-оргазм', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_skvirt_orgazm_2206.5.htm', 'Инфопродукты', 0, '&laquo;Сквиртинг: искусство&hellip;&raquo; &ndash; оффер для мужской аудитории, предлагающий различные рекомендации для внесения в интимную жизнь еще больше разнообразия и удовольствия. Методика состоит из советов и уникальных техник, эффективность которых дает 100% гарантии и подтверждена положительными отзывами женщин и мужчин.\r\n	При заказе DVD-курса все покупатели получают бесплатные бонусы и возможность возврата товара.\r\n	Данная методика предназначена для лиц старше 18 лет.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2206', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:54'),
(2207, 'Инфопродукты: Секс-фигура', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_seks_figura_2207.5.htm', 'Инфопродукты', 0, 'DVD-курс &laquo;Секс-фигура&raquo; - это методика, которая содержит оригинальные советы о том, как привести свое тело в порядок в домашних условиях. Здесь подобраны эффективные упражнения, а также советы по правильному питанию: перечень полезных продуктов, направленных на сжигание жира и оздоровление организма.\r\n	С помощью данной методики больше нет нужды посещать тренажерные залы, обращаться к диетологам или пластическим хирургам и принимать пищевые добавки.\r\n	Курс составлен профессионалами, а его эффективность подтверждена положительными отзывами женщин и мужчин.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2207', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:54'),
(2208, 'Инфопродукты: Идеальный мужчина', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_idealnyiy_muzhchina_2208.5.htm', 'Инфопродукты', 0, 'Методика &laquo;Идеальный мужчина&raquo; - это целая система рекомендаций для оздоровления, которая состоит из советов по правильному питанию и эффективным упражнениям, подходящих для мужчин любого возраста и телосложения.\r\n	Все упражнения выполняются в домашних условиях без применения дорогостоящих пищевых добавок и таблеток, обращения в медицинские центры и посещения тренажерных залов.\r\n	Заказывая товар, покупатель абсолютно бесплатно получает дополнительную продукцию в качестве приятного бонуса.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2208', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:54'),
(2209, 'Инфопродукты: Средство от прыщей', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_sredstvo_ot_pryischey_2209.5.htm', 'Инфопродукты', 0, '&laquo;Квотлан&raquo; - средство от прыщей, разработанное ведущими врачами-дерматологами и кандидатами медицинских наук для быстрого и эффективного избавления от прыщей.\r\n	Данный крем подходит для людей любого возраста, состоит из натуральных компонентов и абсолютно безопасен для здоровья.\r\n	При заказе товара все покупатели получают приятные подарки.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2209', ' 													 - 											', '650,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:54'),
(2275, 'E5', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/e_2275.5.htm', 'Одежда и обувь, Видео, Телефоны, Электроника и Фото, Бытовая техника, Компьютеры, Музыка, Товары для строительства и ремонта, Оборудование, Подарки, сувениры, цветы', 0, 'Компания Е5 является одной из крупнейших розничных компаний по продаже продовольственных товаров на территории Российской Федерации.\r\n	Компания успешно осуществляет доставку товаров из магазинов, супермаркетов и гипермаркетов под брендами &laquo;Пятерочка&raquo;, &laquo;Перекресток&raquo; и &laquo;Карусель&raquo;, где покупатель может заказать товары в&nbsp; любой категории: продукты питания, компьютеры и электроника, товары для детей и животных, товары для дома, офиса, дачи, хозтовары, книги и игрушки, сувениры, подарки и многое другое.\r\n	Благодаря сотрудничеству с проверенными поставщиками, Е5 гарантирует качество поставляемых товаров, а также предоставляет отличный сервис, быструю доставку.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2275', ' 													 - 											', '1,30% - 19,56%', '33 140.04', '10 130.56', 148, NULL, '2013-12-04 16:36:54'),
(2345, 'Letro', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/letro_2345.5.htm', 'Одежда и обувь, Подарки, сувениры, цветы', 1, 'Интернет-магазин Letro предлагает покупателям широкий выбор женской и мужской одежды, аксессуаров и обуви, реализуемых без посредников. Это отличная возможность для молодых начинающих дизайнеров и модельеров не только представить свои коллекции и изобретения, но и продать их по выгодной им и клиенту цене.\r\n	В магазине Letro покупатели найдут модные и эксклюзивные товары, произведенные из натуральных и качественных материалов.\r\n	Проект Letro поддерживают многие молодые дизайнеры из России, такие как Ирина Прасолова, Диана Уланова, Анна Иванова, Дина Ковалева, Леонид Куприянов и многие другие.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2345', ' 													360,00											', '-', '0.00', '0.00', 142, NULL, '2013-12-04 16:36:54'),
(2355, 'Кодекс Пирата', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/kodeks_pirata_2355.5.htm', 'Онлайн-игры', 1, 'Кодекс Пирата &ndash; бесплатная браузерная онлайн-игра в жанре военно-экономической стратегии, главной целью которой являются бесконечные сражения с другими игроками за право власти над Океаном. Игрок получает остров, развивает его, строит здания и укрепляет оборону, создавая в итоге свою собственную морскую империю, готовую выйти на сражения с врагами.\r\n	Основными ресурсами игры являются Дерево, Золото и Ром, также в вашем распоряжении 40 разнообразных юнитов: пиратские судна, бесстрашная артиллерия, кровожадные головорезы и легендарные чудовища.\r\n	Принимайте участия в сражениях, топите корабли, захватывайте колонии, получайте награды и опыт, увеличивайте свое войско и завоевывайте новые территории.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2355', ' 													10,00											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:54'),
(2505, 'FinlineUA', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/finlineua_2505.5.htm', 'Продукты, напитки, табак, Финансы и Банки', 1, 'Онлайн-сервис FinlineUA &ndash; это только лучшие и выгодные предложения по подбору кредитных карт и кредитов от украинских банков.\r\n	Здесь собраны готовые кредитные решения от таких банков как Дельта Банк, Ренессанс Кредит, Банк Русский Стандарт, ПриватБанк, Альфа-банк, Банк Траст, ОТР Bank и многих других крупнейших банковских учреждений.\r\n	Благодаря большому выбору кредитных продуктов, клиент имеет возможность подобрать самый оптимальный и выгодный для него вариант.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2505', ' 													78,00											', '-', '1 597.88', '2 045.29', 149, NULL, '2013-12-04 16:36:54'),
(2555, 'Пароград', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/parograd_2555.5.htm', 'Онлайн-игры', 1, 'Пароград &ndash; браузерная ролевая онлайн-игра от разработчиков Mechanist Games, выполненная в стимпанк-стиле. Игрока ждет альтернативный мир паровых технологий, называемый Вселенский Механизм, населенный разными расами. Каждая из 10 представленных рас имеет подрасы со своими навыками и способностями, которые необходимо развивать и дополнять новыми умениями.\r\n	В игре представлен широкий выбор оружия, брони и другой экипировки, в том числе транспорта (паровые мотоциклы, дирижабли, паровозы), а также возможность участвовать в коллективном прохождении квестов, выполнение которых поощряется наградами и полезными предметами.\r\n	Пароград &ndash; это удобный интерфейс, различные по уровню сложности задания, захватывающие сражения и интересный сюжет.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2555', ' 													 - 											', '33,88 - 59,76', '5 784.33', '3 675.12', 1, NULL, '2013-12-04 16:36:54'),
(2585, 'CityCredits', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/citycredits_2585.5.htm', 'Финансы и Банки', 0, 'CityCredits - агрегатор банковских офферов с персональным подбором кредитов и кредитных карт для каждого пользователя.\r\n	CityCredits для вебмастеров &ndash; это высокоэффективный способ монетизации трафика.\r\n	Наши преимущества по сравнению с обычными банковскими офферами:\r\n	- удобный и качественный 2х-шаговый лендинг;\r\n	- инструменты многоканального маркетинга для повышения заработка вебмастера;\r\n	- хороший выбор только проверенных офферов.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2585', ' 													 - 											', '70,00%', '6 838.93', '14 764.41', 2, NULL, '2013-12-04 16:36:54'),
(2595, 'Сим 24', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/sim_2595.5.htm', 'Услуги', 1, 'Сим24 &ndash; это интернет-магазин, который является официальным представителем таких известных операторов сотовой связи как Билайн, Мегафон, МТС и предлагает самые выгодные безлимитные тарифы на услуги мобильной связи и интернета.\r\n	Данные тарифы разработаны ведущими операторами для ограниченного круга лиц и возможность их подключения есть только в Сим24, что делает его эксклюзивным интернет-магазином.\r\n	Сим24 &ndash; это корпоративные планы по низким ценам, консультации по оформлению и покупке, а также акции, скидки и подарки для всех покупателей.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2595', ' 													 - 											', '300,00', '0.00', '0.00', 23, NULL, '2013-12-04 16:36:54'),
(2635, 'Infestation', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infestation_2635.5.htm', 'Онлайн-игры', 0, 'Infestation &ndash; это клиентская онлайн-игра, действие которой происходит в опасном мире зомби-апокалипсиса.\r\n	Игроку предстоит сражаться не только с армией живых мертвецов, но и другими игроками, ведь главная цель &ndash; выжить любым способом, используя смекалку и свою собственную стратегию.\r\n	Вам предлагается большой выбор оружия и экипировки, обширная игровая территория и полная свобода действий.&nbsp;&nbsp;&nbsp;\r\n	Объединяйтесь с другими пользователями или играйте в одиночку, выполняйте различные задания для развития персонажа, ищите ценные предметы, чтобы пройти этот путь до конца.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2635', ' 													30,00											', '-', '4 154.49', '4 410.15', 1, NULL, '2013-12-04 16:36:54'),
(2655, 'Rise of Heroes', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/rise_of_heroes_2655.5.htm', 'Онлайн-игры', 1, 'Rise of Heroes &ndash; браузерная онлайн-игра, действие которой происходит в красочном мире, где смешаны культура Ближнего Востока и стимпанковские технологии.\r\n	Игрок становится владельцем сначала маленького государства и по ходу игры начинает увеличивать его, развивать инфраструктуру и создавать армии.\r\n	Все персонажи игры наделены своими особенностями и уникальными способностями, которые они используют в боях против других игроков для завоевания новых территорий, поиска кладов и участия в различных квестах.\r\n	Участвуйте в глобальных битвах и становитесь правителем мира!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2655', ' 													 - 											', '12,78 - 42,18', '4 058.62', '3 930.79', 1, NULL, '2013-12-04 16:36:55'),
(2695, 'Инфопродукты: Слендер', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_slender_2695.5.htm', 'Инфопродукты', 0, 'Метод Слендер+ направлен на быстрое и гарантированное снижение веса у женщин и мужчин в домашних условиях.\r\n	Эффективность метода доказана полученными наградами и призовыми местами на специализированных выставках по всему миру, а также тысячами положительных отзывов покупателей.\r\n	Для того чтобы начать использовать данный курс, достаточно установить программу на компьютере.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2695', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:55'),
(2705, 'Инфопродукты: Йохимбе Форте', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_yohimbe_forte_2705.5.htm', 'Инфопродукты', 0, 'Йохимбе Форте &ndash; лекарственный препарат для мужской аудитории, способный восстановить мужское здоровье и помочь избавиться от всех комплексов в личной жизни.\r\n	Йохимбе Форте создан на основе натуральных трав, поэтому абсолютно безопасен в применении и не имеет аналогов во всем мире.\r\n	Многие мужчины и женщины уже подтвердили эффективность данного продукта.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2705', ' 													 - 											', '650,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:55'),
(2725, 'Инфопродукты: Green Coffee', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_green_coffee_2725.5.htm', 'Инфопродукты', 0, 'Green Coffee &ndash; это натуральный продукт, который поможет избавиться от лишнего веса, не причиняя вред организму и не вызывая привыкания. Благодаря различным витаминам и жирным кислотам, входящим в состав продукта, зеленый кофе оказывает положительное воздействие на организм, подавляя чувство голода и нормализуя микрофлору.\r\n	Дневная доза зеленого кофе для снижения веса &ndash; всего 2 пакетика по 800 гр.\r\n	Эффективность продукции доказана многочисленными благодарными отзывами потребителей.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2725', ' 													 - 											', '650,00', '0.00', '3 163.80', 24, NULL, '2013-12-04 16:36:55'),
(2735, 'Инфопродукты: Мега-фигура', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_mega_figura_2735.5.htm', 'Инфопродукты', 0, '', '', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:55'),
(2745, 'Инфопродукты: Метод Slimmer', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_metod_slimmer_2745.5.htm', 'Инфопродукты', 0, 'Программа &laquo;25 кадр: Метод Slimmer&raquo; позволяет избавиться от лишнего веса при помощи заложенного в нее 25 кадра, который&nbsp; сразу после запуска курса начинает незаметно влиять на пользователя и позволяет достичь колоссальные результаты по снижению веса за короткий срок.\r\n	&laquo;25 кадр: Метод Slimmer&raquo; рассчитана как на женскую, так и на мужскую аудиторию, абсолютна безопасна для здоровья и&nbsp; не требует посещений тренажерных залов и применения лекарственных препаратов. Позитивные отзывы клиентов доказывают эффективность курса &laquo;25 кадр: Метод Slimmer&raquo;.\r\n	Для того чтобы начать использование курса, достаточно запустить DVD-диск на ноутбуке или компьютере.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2745', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:55'),
(2755, 'Инфопродукты: Диета 25', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_dieta_2755.5.htm', 'Инфопродукты', 0, 'Курс &laquo;Диета 25&raquo; - оптимальный вариант для похудения в домашних условиях.\r\n	Благодаря встроенному в программу 25 кадру, больше не нужно прибегать к дополнительным действиям: придерживаться диет, посещать тренажерные залы, прибегать к помощи пластических хирургов или лекарствам.\r\n	Программа полностью безопасна и начинает работать сразу после запуска DVD-диска на компьютере или ноутбуке.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2755', ' 													 - 											', '1''000,00', '0.00', '3 930.79', 24, NULL, '2013-12-04 16:36:55'),
(2765, 'iLux', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/ilux_2765.5.htm', 'Одежда и обувь, Подарки, сувениры, цветы', 0, 'iLux &ndash; интернет-магазин изысканных вещей от брендовых производителей, где покупатели найдут одежду, аксессуары, канцелярские принадлежности для себя или в качестве подарков деловым партнерам и близким людям.\r\n	Магазин является единственным в России представителем таких мировых брендов как Gourji, Piquadro, Tibaldi, Montegrappa, El Casco, Caran D&#39;ache.\r\n	Удобная система поиска и покупки товаров сделают сэкономят время покупателей, а качественный первоклассный сервис и специальные предложения постоянным клиентам порадуют любого клиента.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2765', ' 													 - 											', '10,00%', '0.00', '341 882.45', 142, NULL, '2013-12-04 16:36:55'),
(2775, 'Enter', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/enter_2775.5.htm', 'Подарки, сувениры, цветы, Товары для дома и дачи, Товары для офиса, Товары для детей, Бытовая техника, Одежда и обувь, Телефоны, Электроника и Фото, Компьютеры', 0, 'Интернет-магазин Enter &ndash; это огромный выбор непродовольственных товаров от мебели до аксессуаров и подарков, расположенных на одном сайте.\r\n	В ассортименте продукции покупатели найдут товары для дома, офиса и дачи, оргтехнику и электронику, товары для детей, косметику и парфюмерию, запчасти для автомобилей, спортивные товары и многое другое.\r\n	Сделать заказ простым и быстрым помогут квалифицированные специалисты, которые ответят на все вопросы и подберут необходимый товар. При запросе покупателя сервисная служба оказывает услуги настройки, подключения и установки техники или тренажеров, а также проводят инструктаж по правильному использованию компьютерной продукции.\r\n	Enter &ndash; это гарантия качества, удобства и отличного сервиса!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2775', ' 													 - 											', '0,50% - 12,35%', '0.00', '1 917.46', 150, NULL, '2013-12-04 16:36:55'),
(2785, 'EstetiClub: омоложение лица', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/esteticlub_omolozhenie_litsa_2785.5.htm', 'Товары для красоты и здоровья', 1, 'EstetiClub создан для того, чтобы женщины всегда были в курсе последних новинок и разработок в сфере Красоты и Здоровья: это эффективные средства и процедуры для омоложения, уходом за кожей и фигурой. Это клуб, объединяющий тысячи успешных женщин, которые заботятся о своем внешнем виде и хотят быть молодыми и здоровыми.\r\n	Своим участницам EstetiClub любит дарить подарки и приятные бонусы в виде VIP-сертификатов на посещение процедур или приобретение препаратов.\r\n	EstetiClub всегда открыт для сотрудничества с компаниями, работающими в данной сфере и готов предоставить самые актуальные и интересные предложения по продвижению продукции.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2785', ' 													 - 											', '120,00', '195 548.58', '19 749.80', 36, NULL, '2013-12-04 16:36:55'),
(2805, 'Baza-Shop', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/baza_shop_2805.5.htm', 'Оборудование, Электроника и Фото', 1, 'Магазин Baza-Shop &ndash; это продажа профессионального оборудования для диджеев и аппаратуры для проведения клубных вечеринок и различных мероприятий.\r\n	Здесь покупатели могут приобрести любое техническое оборудование как для студийного или домашнего использования, так и для клубных площадок.\r\n	В ассортименте продукции представлены товары разных категорий: световое оснащение, диджейские пульты, винил, звуковое и студийное оборудование, а также огромный выбор аксессуаров.\r\n	Сотрудники магазина &ndash; музыканты и диджеи, которые с удовольствием помогут подобрать товар и рассказать о всех его преимуществах.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2805', ' 													 - 											', '280,00', '4 378.19', '10 162.52', 37, NULL, '2013-12-04 16:36:55'),
(2815, 'Taobao', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/taobao_2815.5.htm', 'Бытовая техника, Электроника и Фото, Телефоны, Одежда и обувь, Музыка, Товары для авто- и мототехники, Спортивные товары, Товары для детей, Товары для офиса, Компьютеры', 1, 'Компания Taobao является надежным посредником крупнейшего одноименного китайского интернет-магазина.\r\n	В каталоге магазина представлены товары различных категорий: одежда, обувь и аксессуары, ювелирные изделия, спортивные товары, компьютеры и электроника, музыкальные инструменты, товары для дома, офиса и автомобилей, сувениры и подарки.\r\n	Taobao обслуживает более полумиллиона покупателей на территории России, позволяя им приобретать качественные товары по выгодным ценам с доставкой на дом в минимальные сроки.\r\n	Taobao обрабатывает заказы любой сложности и весовой категории, как для розничных, так и для оптовых клиентов.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2815', ' 													230,00											', '-', '2 492.69', '2 524.65', 38, NULL, '2013-12-04 16:36:55'),
(2825, 'Pleer.ru', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/pleer_ru_2825.5.htm', 'Электроника и Фото, Подарки, сувениры, цветы, Товары для дома и дачи, Телефоны, Компьютеры, Товары для красоты и здоровья, Бытовая техника', 1, 'Интернет-магазин Pleer.ru предлагает своим клиентам огромный выбор качественных товаров по приемлемым ценам. Каталог Pleer.ru наполнен продукцией различных категорий от мелкой бытовой техники и электроники, товаров для детей, натуральной косметики до автотехники, товаров для отдыха и туризма, подарков и аксессуаров на любой вкус.\r\n	Удобная система поиска и интерфейс, а также помощь квалифицированных специалистов помогут сделать покупку быстрой и простой.\r\n	Для всех покупателей доступны услуги покупки товара в кредит и его страхования от краж и поломки.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2825', ' 													 - 											', '270,00', '7 254.38', '2 205.07', 151, NULL, '2013-12-04 16:36:55'),
(2875, 'Тонгкат', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/tongkat_2875.5.htm', 'Инфопродукты', 0, 'Капсулы Тонгкат &ndash; эффективное средство для восстановления мужского здоровья, которое воздействует на мужской организм и направлен на усиление мужской силы, а также способствует повышению уровня тестостерона.\r\n	Препарат имеет все необходимые сертификаты качества и абсолютно безопасен в применении, что доказывают&nbsp; положительные отзывы как мужской, так и женской аудитории.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2875', ' 													 - 											', '15,00%', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:55'),
(2955, 'Полный Пи - 2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/polnyiy_pi_2955.5.htm', 'Онлайн-игры', 0, 'Полный Пи &ndash; браузерная онлайн игра в жанре комиксов и хоррора, повествующая о невообразимых легендах и предсказаниях конца света. В начале игрок выступает в роли невольного виновника глобальных разрушений и, по ходу прохождения, становится настоящим спасителем вселенной от гибели.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2955', ' 													 - 											', '50,00%', '30 903.00', '5 912.16', 1, NULL, '2013-12-04 16:36:55'),
(2965, 'Инфопродукты: EcoUniversal', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_ecouniversal_2965.5.htm', 'Инфопродукты, Товары для авто- и мототехники', 0, 'EcoUniversal &ndash; экологически чистая присадка для автомобиля, способная восстановить исправную работу двигателя, уберечь его от износа и снизить расход масла, бензина или дизельного топлива.\r\n	Продукт прошел все необходимые исследования и испытания, организованные в Германии, а также имеет сертификаты качества от Белорусского химмологического центра горючего.\r\n	Присадка EcoUniversal доступна по выгодной для всех цене, что позволяет сэкономить время и деньги покупателей.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2965', ' 													 - 											', '920,00', '0.00', '2 173.12', 28, NULL, '2013-12-04 16:36:55'),
(2995, 'Инфопродукты: Slender', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/infoproduktyi_slender_2995.5.htm', 'Инфопродукты', 0, 'В основе программы Slender+ лежит 25 кадр, который за короткий срок поможет избавиться от лишнего веса естесственным путем без применения лекарственных препаратов, походов в спортзалы.\r\n	Для формулирования индивидуальной программы, направленной на снижение веса, необходимо установить диск в компьютер, ввести личные параметры и уделять ей 5-7 минут в день.\r\n	Эффективность Slender+ доказана позитивными отзывами многих покупателей.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=2995', ' 													 - 											', '700,00', '0.00', '0.00', 24, NULL, '2013-12-04 16:36:55'),
(3015, 'Банк Московский Кредитный банк: Кредиты', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_moskovskiy_kreditnyiy_bank_kredityi_3015.5.htm', 'Финансы и Банки', 1, 'Московский Кредитный Банк уже более 20 лет предоставляет полный спектр банковских услуг для частных и корпоративных клиентов, а также для кредитных организаций.\r\n	В основе успешного ведения бизнеса МКБ лежат открытость, инновационные технологии и индивидуальный подход к каждому клиенту: разработка специальных программ, предоставление продуктов и услуг для широкой аудитории, учет всех пожеланий и предложений со стороны клиента.\r\n	Банк имеет всю необходимую документацию и лицензии для осуществления банковской деятельности на территории Российской Федерации.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3015', ' 													 - 											', '220,00', '45 220.01', '15 659.23', 2, NULL, '2013-12-04 16:36:55'),
(3035, 'Travelata', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/travelata_3035.5.htm', 'Путешествия, туризм', 1, 'Travelata &ndash; это туристический портал нового поколения, предоставляющий клиентам самые выгодные и лучшие предложения для путешествий и отдыха.\r\n	Благодаря сотрудничеству с крупными и надежными туропероторами, а также использование современных поисковых технологий и огромный выбор различных туров,&nbsp; Travelata зарекомендовала себя как&nbsp; надежного и качественного поставщика услуг.\r\n	Клиент без труда может забронировать жилье, оплатить тур или перелет с помощью банковской карты и сэкономить на этом время и деньги.\r\n	Travelata &ndash; отличный выбор для запоминающегося отдыха!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3035', ' 													 - 											', '500,00', '2 524.65', '3 163.80', 144, NULL, '2013-12-04 16:36:55'),
(3045, 'Тайный Город', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/taynyiy_gorod_3045.5.htm', 'Онлайн-игры', 1, 'Тайный Город &ndash; это бесплатная браузерная онлайн-игра, созданная по одноименной серии книг писателя Вадима Панова. Действие игры происходит в современной Москве, где на улицах можно встретить не только обычных людей, но и оборотней, рыцарей, волшебников, наемников и представителей древних рас и цивилизаций.\r\n	Игроку предстоит выбрать один из двух Великих Домов и начать жестокую борьбу за власть, используя современные технологии, магию, огнестрельное и холодное оружие.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3045', ' 													10,00											', '-', '3 291.63', '3 739.04', 1, NULL, '2013-12-04 16:36:56'),
(3105, 'PrintClick', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/printclick_3105.5.htm', 'Услуги', 1, 'Компания PrintClick предлагает быстрый и качественный способ заказа и печати визиток, приглашений, календарей, открыток и другой печатной продукции, необходимой для бизнеса, праздников и других мероприятий.\r\n	Используя высококачественные материалы и техническое оборудование, изготовление продукции выполняется в кратчайшие сроки. Клиент также может сделать собственный дизайн с помощью онлайн-конструктора или выбрать макет по своему вкусу среди предложенных на сайте.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3105', ' 													 - 											', '50,00 - 280,00', '5 720.41', '10 833.63', 23, NULL, '2013-12-04 16:36:56'),
(3175, 'Башни', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bashni_3175.5.htm', 'Онлайн-игры', 0, 'Бесплатное приложение в социальной сети ВКонтакте Башни! &mdash; Битва Архимагов предлагает стать участником тактических баталий с применением карт.\r\n	Здесь игрок может строить и развивать свой город, сражаться с другими участниками или друзьями в онлайн-режиме и, самое главное, собрать коллекцию супер-карт, сила которой поможет уничтожить Башню вашего противника.\r\n	На сегодняшний день в приложение играют более 59000 пользователей ВКонтакте.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3175', ' 													 - 											', '50,00%', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:56'),
(3245, 'Black Fire', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/black_fire_3245.5.htm', 'Онлайн-игры', 1, 'Black Fire &ndash; клиентская онлайн-игра, разработанная на базе игрового движка Unreal Tournament, главной тематикой которой является выполнение различных миссий и заданий в разных уголках планеты и отстреливание врагов &ndash; зомби, монстров и даже людей.\r\n	Огромный выбор оружия и боеприпасов, возможность носить два вида боевых единиц одновременно, реалистичные PvP и PvE-сражения, постоянные обновления и дополнения в игре сделали Black Fire одним из самых популярных шутеров во всем мире.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3245', ' 													 - 											', '20,00', '2 268.99', '2 652.48', 1, NULL, '2013-12-04 16:36:56');
INSERT INTO `offers` (`id`, `name`, `offerlink`, `category`, `locked`, `description`, `bannerlink`, `cpl`, `cpa`, `epc7d`, `epc90d`, `category_id`, `created_at`, `updated_at`) VALUES
(3275, 'My Lands - 4', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/my_lands_3275.5.htm', 'Онлайн-игры', 1, 'My Lands - браузерная онлайн-стратегия с возможностью вывода игровых денег в реальные. Эта MMORPG не требует установки на компьютер &ndash; достаточно выйти в интернет с любого браузера и начать игру. Графика этой военно-экономической стратегии в реальном времени вдохновлена Heroes of Might and Magic, а сама игра признана &laquo;Лучшей браузерной игрой 2010 года&raquo; по мнению ConfOg. Четыре классические расы на выбор: эльфы, дроу (темные эльфы), рыцари и демоны позволяют определенные бонусы в игре, а битва 2 фракций &ndash; Темной (дроу и демоны) и Светлой (рыцари и эльфы) &ndash; делают игру интереснее.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3275', ' 													0,20 - 0,90											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:56'),
(3435, 'Банк Первомайский', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_pervomayskiy_3435.5.htm', 'Финансы и Банки', 1, 'Банк Первомайский является одним из крупнейших банков Южного Федерального Округа по предоставлению любых финансовых операций для физических и юридических лиц: оформление кредитов, займов, депозитов, кредитных карт по самым выгодным для клиентов условиям.\r\n	Все операции производятся под четким контролем квалифицированных специалистов, способных в любой момент дать точную информацию об интересующем продукте.\r\n	Благодаря успешному развитию, банк продолжает расширяться и внедрять в свою политику инновационные технологии для более удобного для клиентов использования банковских услуг.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3435', ' 													 - 											', '50,00 - 100,00', '0.00', '0.00', 2, NULL, '2013-12-04 16:36:56'),
(3445, 'IntimShop', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/intimshop_3445.5.htm', 'Товары для красоты и здоровья', 1, 'Интернет-магазин IntimShop уже на протяжении 10 лет предлагает своим покупателям широкий ассортимент товаров для взрослых и является лидером среди подобных магазинов на территории Российской Федерации.\r\n	Все товары произведены из натуральных материалов, что гарантирует качество и долговечность продукции. Благодаря сочетанию качества и приемлемым ценам, количество постоянных клиентов Intimshop увеличивается с каждым днем.\r\n	Оплата товаров производится любым удобным для покупателя способом в любую точку России.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3445', ' 													408,00											', '-', '45 699.37', '29 912.32', 36, NULL, '2013-12-04 16:36:56'),
(3495, 'Proball', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/proball_3495.5.htm', 'Спортивные товары, Подарки, сувениры, цветы, Одежда и обувь', 0, 'Интернет-магазин Proball предлагает своим покупателям огромный выбор качественной спортивной одежды, обуви, инвентаря и аксессуаров для тех, кто любит активный образ жизни.\r\n	В магазине представлены товары таких известных производителей спортивной экипировки как Adidas, Puma, Nike и многих других брендов.\r\n	Proball гарантирует высокое качество обслуживания, индивидуальный подход к каждому клиенты, быструю доставку товара, выгодные, доступные для всех цены, а также гибкую систему скидок для постоянных покупателей.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3495', ' 													 - 											', '8,00%', '0.00', '0.00', 152, NULL, '2013-12-04 16:36:56'),
(3505, 'MTS Shop', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/mts_shop_3505.5.htm', 'Телефоны, Услуги', 0, 'Компания МТС представляет интернет-магазин MTS Shop, где частные и корпоративные клиенты могут приобрести любую продукцию, сделав заказ в Интернете по самым выгодным ценам.&nbsp;\r\n	Каталог магазина наполнен различными моделями смартфонов, мобильных устройств, планшетов, ноутбуков, приставок и другой электроникой, фото и видео-техникой и аксессуарами от ведущих мировых компаний-производителей таких как Apple, Nokia, Samsung, HTC, Sony и другие.\r\n	MTS Shop &ndash; это удобная система поиска товара, возможность сделать предзаказ, а также приобрести любые интересующие тарифы и приложения от МТС и поучаствовать в выгодных акциях!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3505', ' 													 - 											', '2,50%', '0.00', '0.00', 41, NULL, '2013-12-04 16:36:56'),
(3515, 'Пилиция', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/pilitsiya_3515.5.htm', 'Онлайн-игры', 0, 'Пилиция - это приложение в ВКонтакте, в котором игроку предстоит стать прилежным стражем порядка и наказывать хулиганов и преступников за нарушение законов.\r\n	После выбора персонажа игрока направляют на выполнение различных заданий по раскрытию преступлений и актов хулиганства, за которые он получает драгоценный опыт, полезные предметы и возможность набрать себе званий и медалей.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3515', ' 													 - 											', '40,00%', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:56'),
(3525, 'Vip Spa', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/vip_spa_3525.5.htm', 'Товары для красоты и здоровья', 1, 'Израильский салон Vip Spa предлагает своим клиентам все спа-услуги для оздоровления и поддержания тела в идеальном состоянии: это различные косметические и спа-процедуры, массажи и многое другое.\r\n	Благодаря новейшему оборудованию, высоким технологиям и профессионально обученному персоналу, клиент получает полный спектр обслуживания.\r\n	Первая процедура в салоне предоставляется абсолютно бесплатно.\r\n	Для получения этой услуги нужно всего заполнить анкету с данными на сайте оффера.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3525', ' 													 - 											', '60,72 - 134,22', '0.00', '0.00', 36, NULL, '2013-12-04 16:36:56'),
(3585, 'People Wear', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/people_wear_3585.5.htm', 'Одежда и обувь', 0, 'Интернет-магазин People Wear &ndash; это огромный выбор удобной и яркой молодежной одежды и аксессуаров по доступным ценам.\r\n	В категориях casual, basic, street, city, trendy и smart собраны коллекции разных стилевых направлений, которые будут интересны современным молодым покупателям.\r\n	Приятная особенность магазина: раздел &laquo;Лукбук&raquo;, где покупатель может просмотреть самые модные сочетания представленных товаров, ознакомиться с новинками и выбрать подходящие именно ему модели.\r\n	Коллекции одежды постоянно обновляются, предлагая покупателям стильные и качественные вещи на все случаи жизни.\r\n	Покажите свой неповторимый стиль вместе с People Wear!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3585', ' 													 - 											', '12,00%', '0.00', '0.00', 5, NULL, '2013-12-04 16:36:56'),
(3625, 'Банк Санкт-Петербург: Кредиты', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_sankt_peterburg_kredityi_3625.5.htm', 'Финансы и Банки', 1, 'Банк Санкт-Петербург предлагает своим клиентам услуги потребительского кредитования на территории Санкт-Петербурга и Ленинградской области.\r\n	Это один из крупнейших банков в данном регионе, заслуживший доверие потребителей благодаря правильно выбранной стратегии ведения работы и качественному обслуживанию физических лиц.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3625', ' 													 - 											', '200,00', '0.00', '15 627.27', 2, NULL, '2013-12-04 16:36:56'),
(3655, 'Юлмарт', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/yulmart_3655.5.htm', 'Компьютеры, Бытовая техника, Электроника и Фото', 0, 'Юлмарт является первым в Российской Федерации кибермаркетом, осуществляющим розничную торговлю бытовой и компьютерной техники, электроники и комплектующих по новым стандартам. Соединяя инновационные технологии и современное программное обеспечение, Юлмарт удалось сделать процесс покупки более простым и быстрым.\r\n	На сегодняшний день в онлайн-каталоге Юлмарт собрано более 30 000 качественных товаров по доступным ценам. Удобная система поиска, сортировки, сравнения, бонусные программы для постоянных клиентов и отличный сервис вывели Юлмарт в число ведущих ритейлеров в России.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3655', ' 													 - 											', '2,00%', '0.00', '10 450.14', 42, NULL, '2013-12-04 16:36:56'),
(3665, 'Dragona', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/dragona_3665.5.htm', 'Онлайн-игры', 1, '', '', ' 													 - 											', '60,00 - 120,00', '3 707.08', '3 930.79', 1, NULL, '2013-12-04 16:36:56'),
(3675, 'Mallstreet', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/mallstreet_3675.5.htm', 'Товары для детей, Музыка, Одежда и обувь, Товары для дома и дачи, Животные и растения, Оборудование, Товары для строительства и ремонта, Электроника и Фото, Телефоны, Бытовая техника, Подарки, сувениры, цветы, Компьютеры, Товары для авто- и мототехники', 1, 'Mallstreet &ndash; это интернет-магазин, предлагающий своим посетителям огромный выбор товаров для детей отличного качества и по доступным каждому ценам.\r\n	В ассортименте магазина представлены все необходимые товары для роста, ухода и развития: кроватки и коляски, игровые площадки, различные развивающие игры, одежда и обувь, детское питание, постельные принадлежности, подгузники и многое другое.\r\n	Благодаря успешному сотрудничеству с лучшими мировыми производителями, оперативной работе менеджеров по продажам, удобному интерфейсу сайта и выгодным ценам, Mallstreet по праву считается надежным поставщиком товаров для детей.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3675', ' 													200,00											', '-', '0.00', '9 395.54', 153, NULL, '2013-12-04 16:36:56'),
(3815, 'Ostin', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/ostin_3815.5.htm', 'Одежда и обувь', 1, 'Интернет-магазин Ostin предлагает своим покупателям широкий модельный ряд стильной, комфортной и современной одежды для женщин и мужчин. Здесь представлены модные коллекции повседневной одежды и аксессуаров для тех, кто любит качество, простоту и удобство.\r\n	Все представленные в магазине товары отличаются практичностью, удобством, не требуют специального ухода, а также доступны для покупателей любого класса.\r\n	Ostin &ndash; одежда для уверенных в себе людей!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3815', ' 													 - 											', '275,00', '0.00', '12 846.96', 5, NULL, '2013-12-04 16:36:56'),
(3835, 'CTOKmarket', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/ctokmarket_3835.5.htm', 'Одежда и обувь, Товары для красоты и здоровья, Подарки, сувениры, цветы', 0, 'Интернет-магазин Ctokmarket предлагает своим покупателям широкий выбор товаров разных категорий по доступным ценам: декоративная косметика, элитная парфюмерия, стильные сумки и часы знаменитых марок, бижутерия, галантерея и многое другое.\r\n	Удобная система поиска и оплаты покупки, отзывчивые консультанты и постоянно расширяющийся ассортимент товаров сделают процесс покупки легким и приятным.\r\n	Ctokmarket&nbsp;реализует товары по складским ценам, а также проводит различные акции и распродажи для своих покупателей.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3835', ' 													 - 											', '9,12%', '0.00', '162 504.42', 154, NULL, '2013-12-04 16:36:57'),
(3905, 'Банк Райффайзен: Кредитные Карты', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_rayffayzen_kreditnyie_kartyi_3905.5.htm', 'Финансы и Банки', 0, 'С 1996 года Банк Райффайзен успешно ведет свою деятельность по оказанию полного спектра банковских услуг физическим и юридическим лицам, а также малому, среднему бизнесу и корпоративным клиентам. Это дочернее предприятие, осуществляющее операции как в рублевой, так и в иностранной валюте.\r\n	В любом отделении банка или на официальном сайте клиент может оформить кредитную карту, кредит, займы и другие банковские услуги по выгодным условиям и процентным ставкам.\r\n	Банк Райффайзен является не только почетным членом российских и международных организаций, работающих в сфере финансовых операций, торговли и банковской индустрии, но и надежным партнером для своих клиентов по всему миру.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3905', ' 													 - 											', '1''400,00', '11 185.16', '5 592.58', 2, NULL, '2013-12-04 16:36:57'),
(3915, 'Банк Райффайзен: Потребительские Кредиты', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_rayffayzen_potrebitelskie_kredityi_3915.5.htm', 'Финансы и Банки', 1, 'С 1996 года Банк Райффайзен успешно ведет свою деятельность по оказанию полного спектра банковских услуг физическим и юридическим лицам, а также малому, среднему бизнесу и корпоративным клиентам. Это дочернее предприятие, осуществляющее операции как в рублевой, так и в иностранной валюте.\r\n	В любом отделении банка или на официальном сайте клиент может оформить кредитную карту, кредит, займы и другие банковские услуги по выгодным условиям и процентным ставкам.\r\n	Банк Райффайзен является не только почетным членом российских и международных организаций, работающих в сфере финансовых операций, торговли и банковской индустрии, но и надежным партнером для своих клиентов по всему миру.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3915', ' 													 - 											', '170,00 - 3''050,00', '6 743.05', '9 970.77', 2, NULL, '2013-12-04 16:36:57'),
(3955, 'McDonalds HR', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/mcdonalds_hr_3955.5.htm', 'Услуги, Продукты, напитки, табак', 1, 'McDonalds &ndash; крупнейшее и одно из самых популярных предприятий быстрого питания во всем мире.\r\n	По данным консалтинговой компании Aon Hewitt компания признана лучшим рекламодателем в России за 2011 год.\r\n	Своим сотрудникам компания предлагает самые лучшие условия по трудоустройству и может по праву гордиться своей сплоченностью и командной работой.\r\n	Работа в McDonalds &ndash; это:\r\n	- гибкий график;\r\n	- стабильная заработная плата, бонусы и вознаграждения;\r\n	- отличная рабочая атмосфера и командный дух;\r\n	- социальный пакет и льготы;\r\n	- бесплатное обучение, лично развитие, возможность реализовать себя;\r\n	- новые друзья и навыки, которые пригодятся в жизни!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3955', ' 													 - 											', '130,00', '0.00', '1 981.37', 155, NULL, '2013-12-04 16:36:57'),
(3965, 'Mobilluck', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/mobilluck_3965.5.htm', 'Электроника и Фото, Подарки, сувениры, цветы, Товары для дома и дачи, Телефоны, Бытовая техника, Компьютеры, Товары для строительства и ремонта, Оборудование, Товары для авто- и мототехники', 0, 'Интернет-магазин Mobilluck &ndash; это огромный ассортимент товаров от ведущих производителей со всего мира: видео, фото,&nbsp; компьютерная и бытовая техника, оборудование для занятия спортом, аксессуары для автомобилей, подарки и сувениры, товары для детей, дачи и ремонта.\r\n	Благодаря успешному ведению бизнеса, выгодным ценам и постоянному обновлению ассортимента, Mobilluck является одним из крупнейших магазинов на Украине.\r\n	Mobilluck &ndash; это гарантированное качество продукции, надежность, экономия денег и времени, а также отличный сервис.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=3965', ' 													 - 											', '222,31', '0.00', '10 929.50', 156, NULL, '2013-12-04 16:36:57'),
(4045, 'Банк ЮниКредит Банк: Кредиты', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_yunikredit_bank_kredityi_4045.5.htm', 'Финансы и Банки', 1, 'ЮниКредит Банк является коммерческим предприятием и уже с 1989 года успешно осуществляет все виды банковских услуг физическим и юридическим лицам, корпоративным и VIP-клиентам, а также малому и среднему бизнесу.\r\n	Это оформление кредитных карт, кредитов, займов, депозитов, ипотечные кредиты и автострахование, открытие и ведение расчетных счетов и многое другое.\r\n	ЮниКредит Банк &ndash; крупнейший банк на территории Российской Федерации, занимающий лидирующие места в рейтингах по объему активов.\r\n	Финансовая деятельность ЮниКредит Банка осуществляется на основании Генеральной лицензии №1 Банка России.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4045', ' 													 - 											', '200,00', '0.00', '2 812.27', 2, NULL, '2013-12-04 16:36:57'),
(4055, 'Е-Заём', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/e_zayom_4055.5.htm', 'Финансы и Банки', 1, 'Микрофинансовая компания Е-Заём с 2012 года оказывает своим клиентам услуги по выдаче займов от 6 000 до 20 000 руб. на территории Российской Федерации.\r\n	Несмотря на недолгое присутствие на финансовом рынке, Е-Заём успела зарекомендовать себя как надежный партнер, удовлетворяющий все запросы своих клиентов.\r\n	Простой порядок оформления и выдачи, квалифицированные специалисты, индивидуальный подход к каждому клиенту и качественное обслуживание позволяют компании держаться на лидирующих позициях в сфере быстрого кредитования.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4055', ' 													 - 											', '500,00', '14 508.75', '1 821.58', 2, NULL, '2013-12-04 16:36:57'),
(4065, 'TopMall', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/topmall_4065.5.htm', 'Одежда и обувь', 1, 'Интернет-магазин TopMall предлагает своим клиентам большой выбор товаров от известных мировых брендов: оригинальная одежда для мужчин, женщин и детей, обувь, различные аксессуары, а также товары для дома и уюта.\r\n	Несмотря на то, что магазин появился сравнительно недавно, его ассортимент уже насчитывает более 10 000 наименований товара и продолжает развиваться и пополняться новыми экземплярами.\r\n	Благодаря сотрудничеству с крупнейшими европейскими фирмами-поставщиками, TopMall является надежным и проверенным на территории Украины магазином по продаже качественных товаров по доступным ценам.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4065', ' 													 - 											', '367,04', '6 263.69', '11 121.25', 5, NULL, '2013-12-04 16:36:57'),
(4085, 'City Travel', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/city_travel_4085.5.htm', 'Путешествия, туризм', 0, 'Сервис City Travel &ndash; эта целая система по поиску лучших предложений по бронированию отелей, гостиниц, авиа и ж/д билетов в любую точку планеты в режиме онлайн.\r\n	На сайте представлено более 200 000 гостиниц любой категории, огромный выбор российских и зарубежных авиакомпаний и тысячи маршрутов следования. Оплатить заказ возможно сразу на сайте с помощью банковского перевода, получив при этом на электронную почту всю необходимую отчетную документацию и информацию о бронировании билетов или номера в гостинице.\r\n	City Travel &ndash; это гарантия качественного отдыха и незабываемых эмоций!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4085', ' 													 - 											', '2,00%', '2 684.44', '8 596.60', 144, NULL, '2013-12-04 16:36:58'),
(4115, 'Fabylonia', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/fabylonia_4115.5.htm', 'Одежда и обувь, Подарки, сувениры, цветы, Телефоны, Бытовая техника, Компьютеры, Товары для детей', 0, 'Fabylonia &ndash; это молодой, но динамично развивающийся интернет-магазин необычных вещей для дома, офиса и тех, кто хочет выделяться из толпы.\r\n	Здесь собраны товары абсолютно разных категорий: дизайнерские украшения и картины, гаджеты, обувь и сумки, товары для кухни, ванной и домашнего уюта, товары для женщин и мужчин, детей и животных, мебель и другие креативные штучки, способные сделать вашу жизнь еще более яркой и стильной.\r\n	Ассортимент магазина постоянно пополняется новинками, а приемлемые цены и условия доставки по всей России делают покупку выгодной и приятной!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4115', ' 													 - 											', '17,50%', '0.00', '0.00', 157, NULL, '2013-12-04 16:36:58'),
(4155, 'Тануки', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/tanuki_4155.5.htm', 'Продукты, напитки, табак', 0, 'Сеть ресторанов японской кухни Тануки является одной из лидирующих и успешно развивающихся предприятий питания на территории Российской Федерации.&nbsp;\r\n	Тануки предоставляет своим клиентам полное меню японских блюд и деликатесов от роллов, закусок, напитков, десертов до фирменных предложений.\r\n	Отличный сервис, круглосуточная доставка заказов на дом и в офис, выгодная ценовая политика и разнообразие всегда свежей продукции, постоянные акции и подарки &ndash; визитная карточка ресторанов Тануки.\r\n	Для всех клиентов, использующих&nbsp; iPhone / iPod, Windows Phone или Android, доступно удобное мобильное приложение.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4155', ' 													 - 											', '50,00', '0.00', '17 864.30', 158, NULL, '2013-12-04 16:36:58'),
(4195, 'Money Man', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/money_man_4195.5.htm', 'Услуги, Финансы и Банки', 1, 'Компания Money Man предоставляет своим клиентам услуги по кредитованию и является первой в России микрофинансовой организацией, полностью осуществляющая свою деятельность в онлайн-режиме.\r\n	В самые короткие сроки Money Man способна выдать займ без сбора документов, поручителей&nbsp; и очередей в банковских отделениях. Все финансовые операции производятся путем начисления денег на банковских свет заемщика, что значительно экономит его время.\r\n	Для получения займа клиенту необходимо всего лишь оформить анкету на сайте рекламодателя.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4195', ' 													70,00											', '-', '6 679.14', '5 816.28', 6, NULL, '2013-12-04 16:36:58'),
(4205, 'ОГО!', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/ogo_4205.5.htm', 'Электроника и Фото', 1, '', '', ' 													325,00											', '-', '9 299.66', '10 897.54', 49, NULL, '2013-12-04 16:36:58'),
(4215, 'RitsAuto', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/ritsauto_4215.5.htm', 'Финансы и Банки', 1, 'Rits Auto &ndash; компания, осуществляющая продажу и услуги сервисного обслуживания таких марок автомобилей как Volkswagen, Kia, Chevrolet, Nissan, Ford, Renault, Mazda, Mitsubishi, Hyundai, Toyota, Skoda, Daewoo, Great wall, Lada и многих других по самым низким и выгодным ценам.\r\n	У каждого покупателя есть возможность пройти тест-драйв, купить автомобиль в кредит или обменять старый на новый и оформить страховку от ведущих страховых компаний.\r\n	Высокий уровень обслуживания, огромный выбор автомобилей, собственный техцентр, различные кредитные программы, а также приятные акции для постоянных клиентов зарекомендовали RitsAuto как настоящих профессионалов на автомобильном рынке.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4215', ' 													290,00											', '-', '0.00', '0.00', 2, NULL, '2013-12-04 16:36:58'),
(4245, 'WarFrame (RU)', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/warframe_4245.5.htm', 'Онлайн-игры', 1, 'Warframe &ndash; клиентская&nbsp; онлайн-игра в жанре shooter, по своему стилю чем-то напоминающая Mass Effect.\r\n	Действие игры происходит на космическом корабле, где игроку предстоит проходить различные квесты, убивая нечисть на своем пути, разгадывая головоломки и улучшая свои навыки.\r\n	Благодаря качественному звуковому и визуальному дизайну, огромному выбору экипировки и модернизации персонажа, разнообразию миссий и заданий, Warframe можно считать одной из успешных онлайн-игр данного жанра.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4245', ' 													24,29											', '-', '4 090.57', '3 994.70', 1, NULL, '2013-12-04 16:36:58'),
(4305, 'МТС Тариф Безлимит', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/mts_tarif_bezlimit_4305.5.htm', 'Услуги', 0, 'МТС Тариф Безлимит предлагает самые выгодные безлимитные тарифы для тех, кто экономит свое время и деньги.\r\n	При заказе сим-карты покупатель имеет возможность получить эксклюзивные подарки: выбрать себе &laquo;красивый номер&raquo;, подключить второй номер или туристическую сим-карту для общения по доступным ценам в путешествиях&nbsp; и командировках, а также другие VIP-услуги.\r\n	Для приобретения сим-карты необходимо просто заполнить свои данные на сайте рекламодателя.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4305', ' 													 - 											', '400,00', '101 401.48', '9 842.94', 23, NULL, '2013-12-04 16:36:58'),
(4315, 'Hoff', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/hoff_4315.5.htm', 'Подарки, сувениры, цветы, Товары для дома и дачи, Товары для детей, Мебель', 0, 'Сеть гипермаркетов Hoff предлагает своим покупателям широкий ассортимент товаров для дома и уюта по доступным ценам: стильная мебель, свет, текстиль, ковры, посуда и предметы для декора.\r\n	Разнообразие ярких красок, новинок и идей для интерьера, сочетание современных тенденций в дизайне, уникальный европейский формат и качественная продукция от ведущих производителей России и Европы обязательно порадуют покупателей.\r\n	Сервисная служба всегда готова предоставить услуги по доставке, сборке и установке мебели.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4315', ' 													 - 											', '300,00 - 1''725,00', '8 916.17', '33 076.12', 159, NULL, '2013-12-04 16:36:58'),
(4325, 'Aliexpress', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/aliexpress_4325.5.htm', 'Электроника и Фото, Компьютеры, Бытовая техника, Телефоны, Одежда и обувь, Подарки, сувениры, цветы', 0, 'Aliexpress является одной из лидирующих в мире компаний-поставщиков, предлагающей своим клиентам товары из Китая оптом и в розницу.\r\n	В ассортименте магазина представлены более 5900 товаров в 44 различных категорий: одежда и аксессуары, товары для детей, электронная техника, все для спорта, красоты и здоровья.\r\n	Представленный товар отвечает всем стандартам качества и поставляется напрямую из Китая, благодаря чему покупатели имеют возможность приобрести их по доступным и выгодным ценам!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4325', ' 													 - 											', '4,00%', '2 876.18', '2 876.18', 160, NULL, '2013-12-04 16:36:58'),
(4355, 'Stylepit', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/stylepit_4355.5.htm', 'Одежда и обувь', 0, 'Stylepit является одним из крупнейших интернет-магазинов по продаже высококачественной&nbsp; мужской, женской, детской одежды, а также аксессуаров из Европы и США.\r\n	В ассортименте магазина представлены такие мировые бренды как Armani, Jack &amp; Jones, Levi&rsquo;s, Lacoste, Diesel и многие другие.\r\n	Вся продукция сертифицирована и произведена из качественных материалов.\r\n	Для всех покупателей в постоянном режиме доступен раздел распродаж, где скидки на товары могут достигать 70%.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4355', ' 													 - 											', '10,00% - 12,00%', '25 661.96', '4 953.43', 5, NULL, '2013-12-04 16:36:58'),
(4385, 'Domalina', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/domalina_4385.5.htm', 'Подарки, сувениры, цветы, Бытовая техника, Товары для дома и дачи', 0, 'Domalina &ndash; интернет-магазин товаров для дома, офиса и дачи, который собрал в себе самые стильные и уютные украшения и дизайнерские решения по доступной ценовой категории.\r\n	Ассортимент продукции насчитывает огромное количество аксессуаров и товаров на любой вкус от ваз и фоторамок до предметов освещения и кухонных принадлежностей, способных добавить оригинальность и современность любому дому.\r\n	Domalina создан при поддержке Otto Group, а данный фактор гарантирует качество товаров, отличный сервис при совершении заказа, а также своевременную доставку.\r\n	Различные акции и распродажи сделают покупку еще более приятной!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4385', ' 													 - 											', '920,00', '0.00', '0.00', 161, NULL, '2013-12-04 16:36:58'),
(4395, 'City Business School', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/city_business_school_4395.5.htm', 'Услуги', 1, 'City Business School предлагает новую систему бизнес-образования с помощью дистанционной формы обучения.\r\n	Это школа нового типа, где студенты имеют доступ к учебным материалам в видео-формате, текстам, мультимедиийным файлам и различным практическим заданиям и тренингам.\r\n	В преподавательский состав входят опытные специалисты и наставники, которые помогают учащимся погрузиться в бизнес-атмосферу путем решения задач различных уровней управления.\r\n	Филиалы City Business School действуют не только на территории России, но и на Украине и Беларуси.\r\n	Помимо индивидуального обучения, школа также предоставляет возможность обучения для корпоративных клиентов, чем уже воспользовались многие компании из разных сфер бизнеса.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4395', ' 													 - 											', '2''200,00', '0.00', '0.00', 23, NULL, '2013-12-04 16:36:58'),
(4425, 'Русский Стандарт: Страхование', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/russkiy_standart_strahovanie_4425.5.htm', 'Финансы и Банки, Услуги', 1, 'Русский Стандарт: Страхование оказывает своим клиентам полный спектр услуг по страхованию имущества, недвижимости и несчастных случаев по самым выгодным и прозрачным условиям.\r\n	Благодаря разнообразию тарифов и быстрому оформлению договоров без анкет и других ненужных действий и документов, компания занимает лидирующие позиции в области страхования на рынке России и заслужила доверие уже более чем двух миллионов физических лиц.\r\n	Все финансовые операции производятся на основе необходимых лицензий в осуществляются в течение 10 дней после страхового случая.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4425', ' 													 - 											', '320,00', '0.00', '0.00', 4, NULL, '2013-12-04 16:36:58'),
(4535, 'Lascana', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/lascana_4535.5.htm', 'Одежда и обувь', 1, 'Lascana - интернет-магазин качественного нижнего белья для женщин от брендовых немецких производителей.\r\n	Ассортимент продукции включает в себя не только большой выбор моделей нижнего белья на любой вкус, но и коллекции домашней и пляжной одежды, купальников и аксессуаров, а также одежды для мужчин.\r\n	Постоянные распродажи и специальные предложения сделают покупку выгодной и незабываемой!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4535', ' 													 - 											', '-', '0.00', '0.00', 5, NULL, '2013-12-04 16:36:58'),
(4545, 'Русская Заемная Компания', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/russkaya_zaemnaya_kompaniya_4545.5.htm', 'Услуги, Финансы и Банки', 0, 'Русская Заемная Компания предоставляет физическим и юридическим лицам полный спектр услуг по консультированию и помощи в получении кредитов на наиболее выгодных условиях. За время своего существования компании удалось добиться высокого уровня качества обслуживания клиентов и конкурентоспособных рыночных цен за предоставляемые услуги. Русская Заемная Компания работает со всеми видами потребительского кредитования, в том числе с перекредитованием и рефинансированием действующих кредитов, а также с ипотечным кредитованием и кредитованием малого и среднего бизнеса.\r\n	Сохранность и конфиденциальность данных клиентов является одним из важнейших приоритетов в работе компании, поэтому для обработки заявок клиентов используется самое современное и надежное программное обеспечение и оборудование.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4545', ' 													 - 											', '145,00 - 4''300,00', '6 359.56', '17 960.17', 6, NULL, '2013-12-04 16:36:59'),
(4585, 'TKT Import', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/tkt_import_4585.5.htm', 'Одежда и обувь', 1, 'Основной деятельностью интернет-магазина TKT Import является импорт различных товаров из США: это широкий ассортимент футболок, балахонов, курток, рубашек и аксессуаров для мужчин, женщин и детей от бренда The Mountain.\r\n	Товары произведены по уникальной технологии из качественных и натуральных материалов, прошедших необходимые проверки и сертификации, что гарантирует их долговечность и безопасность.\r\n	TKT Import предлагает выгодные условия работы как оптовым, так и розничным покупателям.\r\n	Приемлемые и доступные каждому цены приятно удивят всех клиентов!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4585', ' 													185,00											', '-', '12 687.17', '9 874.90', 5, NULL, '2013-12-04 16:36:59');
INSERT INTO `offers` (`id`, `name`, `offerlink`, `category`, `locked`, `description`, `bannerlink`, `cpl`, `cpa`, `epc7d`, `epc90d`, `category_id`, `created_at`, `updated_at`) VALUES
(4595, 'Big Business (GB,RU,US)', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/big_business_4595.5.htm', 'Онлайн-игры', 1, 'Big Business &ndash; онлайн-игра-приложение для iPhone и iPad в жанре тайм-менеджера, где игроку предстоит построить собственную империю бизнеса и заработать свой первый миллион.\r\n	Развивайте город путем постройки заводов и фабрик, жилищных комплексов, ресторанов, кафе, развлекательных центров и других объектов, необходимых для мегаполиса и его жителей.\r\n	Яркая графика, удобный геймлей, различные задания и возможность наладить свой виртуальный бизнес &ndash; все это завоевало любовь игроков со всего мира.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4595', ' 													39,31											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:59'),
(4605, 'Цена свободы', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/tsena_svobodyi_4605.5.htm', 'Онлайн-игры', 1, 'Цена Свободы &ndash; онлайн-игра, завоевавшая свою популярность среди пользователей социальных сетей и теперь доступная для iPad!\r\n	Игрок выступает в роли жертвы сумасшедшего маньяка, называющего себя Кукловодом, и по ходу игры ему предстоит разгадывать различные головоломки, выполнять задания и следовать его указаниям маньяка. Только таким образом игрок сможет выбраться из дома со множеством комнат и разгадать тайну Кукловода.\r\n	Увлекательный сюжет с детективными и философскими составляющими, множество локаций и мастерски воссозданная атмосфера триллера делают процесс игры пугающе интригующим!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4605', ' 													48,90											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:59'),
(4615, 'Промсвязьбанк: Дебетовые карты', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/promsvyazbank_debetovyie_kartyi_4615.5.htm', 'Финансы и Банки', 1, 'Промсвязьбанк &ndash; это универсальный банк, который предоставляет полный комплекс услуг по финансовому обслуживанию физическим и юридическим лицам.\r\n	За время работы банку было присвоено множество высоких рейтингов от мировых рейтинговых агентств, а также он входит в 10-ку ведущих банков России 500 крупнейших мировых банков.\r\n	Главными преимуществами банка являются такие факторы как высокая надежность, оперативные расчеты, минимум документации, гибкие тарифы, быстрое открытие счета, поддержка аналитиков, отсутствие абонентской платы за ведение счета, а также скидки всем клиентам, работающим с банком более полугода.\r\n	Клиентская база Промсвязьбанка насчитывает более 93 000 российских предприятий, более 400 000 вкладчиков и заемщиков и более&nbsp; 1 млн. держателей банковских карт. В региональную сеть входят 250 точек продаж в крупных городах России, представительства в Китае, Индии и на Украине и филиал на Кипре.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4615', ' 													108,00											', '-', '13 581.98', '14 348.96', 2, NULL, '2013-12-04 16:36:59'),
(4625, 'Notik', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/notik_4625.5.htm', 'Компьютеры', 0, 'Notik &ndash; сеть магазинов, специализирующихся на продаже компьютерной электроники, мобильных телефонов, смартфонов и аксессуаров от ведущих мировых производителей.\r\n	В ассортименте магазина представлены самые последние модели планшетов, ноутбуков, нетбуков, моноблоков и гаджетов таких известных марок как Apple, Asus, Fujitsu, Samsung, Panasonic и многих других.\r\n	Покупатели также имеют возможность заказать продукцию в кредит, а для оптовиков и партнеров действуют самые выгодные предложения по сотрудничеству.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4625', ' 													 - 											', '1,00% - 5,00%', '6 934.80', '1 661.80', 29, NULL, '2013-12-04 16:36:59'),
(4635, 'World Of Tanks', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/world_of_tanks_4635.5.htm', 'Онлайн-игры', 1, 'World of Tanks &mdash; клиентская онлайн-игра, посвященная танкам середины ХХ века, где игроку предстоит принимать участие в командных и одиночных PvP-сражениях за мировое танковое господство на стальных гигантах среди других игроков.\r\n	Удобная и продвинутая система прокачки, разнообразие машин и оружия, различные пути прохождения игры, реалистичные спецэффекты и множество потрясающих локаций позволяют по-настоящему прочувствовать боевую атмосферу и настроение игры.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4635', ' 													39,31											', '-', '0.00', '4 985.39', 1, NULL, '2013-12-04 16:36:59'),
(4665, 'Ikariam (Italy)', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/ikariam_italy_4665.5.htm', 'Онлайн-игры', 1, 'Ikariam &ndash; браузерная онлайн-игра в стратегическом жанре. В начале игрок получает небольшой участок земли, требующий развития и расширения, в чем и заключается суть игры.\r\n	Добывайте стройматериалы и ресурсы для строительства зданий, заводов и торговых точек, тренируйте свои войска в специализированных казармах, проходите обучение в академиях\r\n	В игре предусмотрены четыре советника, которые будут направлять игрока и сообщать свежие новости в мире.\r\n	Создавайте альянсы, союзы и торговые отношения с другими игроками, ведь все эти действия помогут вам создать и возглавить могущественную империю.\r\n	Ikariam подходит как для новичков, так и для опытных любителей онлайн-игра данного жанра.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4665', ' 													22,37											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:59'),
(4725, 'Xgame', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/xgame_4725.5.htm', 'Онлайн-игры', 1, 'XGame Online &ndash; бесплатная браузерная игра в стратегическом жанре. Игрок выбирает персонажа из трех представленных классов: шахтер, летчик или ученый и начинает развивать свою еще необжитую планету, добывая ресурсы и создавая оборонительные сооружения, верфи, лаборатории, шахты и другие постройки, в том числе и космические корабли, с помощью которых вы можете отправляться в эспедиции для исследования других планет или же воевать с недоброжелателями. Для более успешных военных действий и развития игры, объединяйтесь в группировки и альянсы, уничтожайте врагов и расширяйте свои территории. Помимо боевого в игре хорошо развит и мирный опыт: налаживайте экономические связи с другими игроками, разрабатывайте новейшие технологии в научной отрасли, пробуйте себя в политике, мир XGame Online дает вам безграничные возможности!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4725', ' 													6,00											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:36:59'),
(4745, 'Piluli', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/piluli_4745.5.htm', 'Аптека', 1, 'Piluli &ndash; это один из крупнейших порталов на территории России о лекарственных травах и продукции для здоровья.\r\n	Здесь представлены ознакомительные и информационные статьи о более чем 20 000 лекарcтвенных препаратах, инструкциях по применению, аналогов и ценовой политики каждого из них.\r\n	Опытные эксперты проведут подробную консультацию по любому продукту, а также посоветуют, в какие медицинские центры и лаборатории следует обратиться для контроля здоровья пациента и&nbsp; получения необходимого лечения.\r\n	На сайте портала также есть возможность заказать любое лекарственное средство с доставкой по указанному адресу.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4745', ' 													305,00											', '-', '28 026.82', '25 214.55', 53, NULL, '2013-12-04 16:36:59'),
(4755, 'BuySKU', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/buysku_4755.5.htm', 'Одежда и обувь, Телефоны, Электроника и Фото, Бытовая техника, Компьютеры', 0, 'BuySKU &ndash; один из крупнейших интернет-магазинов на территории Китая, предлагающий своим покупателям огромный выбор товаров по доступным ценам в таких категориях как: техника и электроника, товары для дома, офиса и спорта, электроника для автомобилей, бижутерия и часы, подарки, сувениры и аксессуары.\r\n	Вся продукция производится в Китае и доставляется на указанный адрес абсолютно бесплатно, что делает покупки на BuySKU не только приятными в использовании, но и выгодными.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4755', ' 													 - 											', '6,15%', '1 233 211.98', '470 415.93', 54, NULL, '2013-12-04 16:36:59'),
(4775, 'Банк Петрокоммерц: Ипотека', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_petrokommerts_ipoteka_4775.5.htm', 'Услуги, Финансы и Банки', 1, 'Банк Петрокоммерц является одним из крупнейших кредитно-финансовых предприятий по оказанию банковских услуг частным, корпоративным и VIP-клиентам, а также малому и среднему бизнесу. Среди основных услуг банка представлены ипотечные и потребительские кредиты, любые рублевые и валютные операции, денежные переводы, оформление вкладов, депозитов и кредитных карт, а также online-сервисы и другие финансовые продукты.\r\n	Благодаря успешной работе с 1992 года, банк Петрокоммерц зарекомендовал себя как надежный партнер с высоким уровнем кредитоспособности среди финансовых предприятий на территории Российской Федерации.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4775', ' 													 - 											', '540,00', '62 541.03', '23 744.50', 6, NULL, '2013-12-04 16:36:59'),
(4785, 'Jagged Alliance', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/jagged_alliance_4785.5.htm', 'Онлайн-игры', 1, 'Jagged Alliance &ndash; браузерная онлайн-игра в жанре тактической стратегии, в которой отряду наемников предстоит освободить маленький остров Метавира, захваченный армией недовольного предпринимателя Лукаса.\r\n	Каждый день игрок должен выполнять различные миссии, которые доступны только в дневное время и в определенном секторе. Если миссия не выполнена &ndash; все игроки в данном секторе считаются погибшими.\r\n	Зарабатывайте деньги с помощью выполнения заданий, развивайте навыки своих наемников, нанимайте других игроков и завоевывайте территории\r\n	Jagged Aliance считается одной из лучших игр данного жанра и сочетает в себе лучшие качества ролевой игры и стратегии.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4785', ' 													12,00											', '-', '2 556.61', '2 492.69', 1, NULL, '2013-12-04 16:37:00'),
(4795, 'Банк Юникредит: Кредиты 2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/bank_yunikredit_kredityi_4795.5.htm', 'Финансы и Банки', 1, 'ЮниКредит Банк является коммерческим предприятием и уже с 1989 года успешно осуществляет все виды банковских услуг физическим и юридическим лицам, корпоративным и VIP-клиентам, а также малому и среднему бизнесу.\r\n	Это оформление кредитных карт, кредитов, займов, депозитов, ипотечные кредиты и автострахование, открытие и ведение расчетных счетов и многое другое.\r\n	ЮниКредит Банк &ndash; крупнейший банк на территории Российской Федерации, занимающий лидирующие места в рейтингах по объему активов.\r\n	Финансовая деятельность ЮниКредит Банка осуществляется на основании Генеральной лицензии №1 Банка России.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4795', ' 													230,00											', '-', '17 512.77', '17 576.68', 2, NULL, '2013-12-04 16:37:00'),
(4835, 'NaTebe', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/natebe_4835.5.htm', 'Одежда и обувь', 0, '', '', ' 													 - 											', '-', '0.00', '305 290.99', 5, NULL, '2013-12-04 16:37:00'),
(4865, 'E96', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/e_4865.5.htm', 'Товары для детей, Товары для строительства и ремонта, Бытовая техника, Электроника и Фото, Телефоны, Одежда и обувь', 1, 'E96 - динамично развивающийся интернет-магазин бытовой техники и электроники, который предлагает своим покупателям огромный ассортимент из более чем 400 категорий товаров по доступным ценам.\r\n	В каталоге представлены лучшие мировые бренды-производители качественной электронной продукции для дома, офиса, дачи и автомобилей.\r\n	E96 &ndash; это оперативная доставка, ежедневно пополняющийся ассортимент, оплата только после получения и проверки заказа и и проверенное качество продукции.\r\n	\r\n	Официальный сайт: http://e96.ru/', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4865', ' 													270,00											', '-', '22 178.58', '16 969.49', 55, NULL, '2013-12-04 16:37:00'),
(4875, 'Might & Magic: Duel of Champions', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/might_magic_duel_of_champions_4875.5.htm', 'Онлайн-игры', 1, 'Might and Magic: Duel of Champions&nbsp; - это стратегическая онлайн-игра в жанре карточного менеджера, действие которой происходит во вселенной Might &amp; Magic.\r\n	Игрок выбирает сторону, на которой будет играть: Альянс Света, Инферно или Некрополис и создает свою непобедимую армию.\r\n	Каждый противник в Duel of Champions&nbsp; - реальный игрок со своей уникальной тактикой и коллекцией игральных карт.\r\n	Для успешного прохождения игры и увеличения карточной коллекции вам понадобится использовать свои стратегические навыки, а также различные тактические приемы.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4875', ' 													19,00											', '-', '4 122.53', '4 633.85', 1, NULL, '2013-12-04 16:37:00'),
(4885, 'MercElite', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/mercelite_4885.5.htm', 'Онлайн-игры', 1, 'Бесплатная браузерная онлайн-игра MercElite выполнена в жанре МОВА-шутер и придется по вкусу всем любителям данного направления.\r\n	Действие игры происходит в ближайшем будущем, где игроку предстоит принимать участие в яростных перестрелках с другими игроками, создавать свой отряд наемников, улучшать навыки персонажей путем побед, приобретения опыта и дополнительных возможностей.\r\n	Огромное разнообразие миссий, заданий и локаций, уникальная боевая система, удобный геймплей, реалистичная прорисовка персонажей и детализированная графика позволяют полностью окунуться в боевую атмосферу игры.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4885', ' 													11,66											', '36,70', '4 058.62', '4 537.98', 1, NULL, '2013-12-04 16:37:00'),
(4965, 'Kings Empire [iPhone, iPad]', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/kings_empire_iphone_ipad_4965.5.htm', 'Онлайн-игры', 1, 'Kings Empire &ndash; онлайн-игра, в которой игроку предстоит принять участие в массовых турнирах и сражениях за Мировое Господство, чтобы вернуть Славу и Силу цивилизации, потерпевшей крушение сотни лет назад.\r\n	Расширяйте территории своей империи, уничтожайте врагов и завоевывайте новые земли, вступайте в альянсы с другими игроками и увеличивайте силу своих войск.\r\n	В игре представлено множество тактик ведения боевых действий, различных умений и способов развития персонажей, а также возможность исследовать и создавать новейшие технологии по улучшению городов и армии.&nbsp;', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4965', ' 													63,00											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:00'),
(4985, 'Wizardry Online', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/wizardry_online_4985.5.htm', 'Онлайн-игры', 1, 'Wizardry Online &ndash; клиентская онлайн-игра, основанная на одноименной серии классических RPG. Действие игры происходит в мрачном, но стильном фентезийном мире с глубоко проработанной историей и мифологией. Для игрока доступны четыре профессии &ndash; воин, маг, вор и жрец, но по ходу игры будет возможность сочетать навыки каждого персонажа и пять рас -&nbsp; человек, эльф, дворф, гном и поркули.\r\n	Wizardry Online имеет довольно сложный геймплей: открытый PvP, кражи у других игроков, а также возможность потерять персонажа в бою и оригинальность квестов увеличивает ценность каждого заработанного уровня и стимулирует игроков к сотрудничеству.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=4985', ' 													22,00											', '-', '3 643.17', '2 908.14', 1, NULL, '2013-12-04 16:37:00'),
(5015, 'Выбери приз-1', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/vyiberi_priz_5015.5.htm', 'Конкурсы', 1, 'Выбери приз &ndash; отличная возможность для пользователей выиграть полезные призы на свой выбор.\r\n	В призовом фонде представлены планшеты, смартфоны, компьютеры от Apple, различные акции и купоны на покупки от таких магазинов как Пятерочка, Quelle, банковские предложения, а также купоны на изучение иностранных языков.\r\n	Для того чтобы принять участие в розыгрыше, необходимо заполнить заявку на сайте рекламодателя.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5015', ' 													21,59											', '-', '0.00', '0.00', 56, NULL, '2013-12-04 16:37:00'),
(5055, 'Mobile Poker Club', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/mobile_poker_club_5055.5.htm', 'Онлайн-игры', 0, 'Мобильное приложение Mobile Poker Club &ndash; это возможность для пользователей Andoid абсолютно бесплатно играть в покер в онлайн-режиме как за игровые, так и за реальные деньги.\r\n	Особенностями приложения являются удобный, созданный специально для мобильных телефонов и КПК, интерфейс, постоянные игровые обновления, турниры и гарантированные призы для всех участников, а также всегда стабильное и быстрое соединение и экономичный трафик.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5055', ' 													51,13											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:00'),
(5075, 'Mebelion', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/mebelion_5075.5.htm', 'Мебель, Товары для дома и дачи', 0, 'Mebelion является одним из крупнейших интернет-магазинов по продаже товаров для домашнего обустройства и уюта от таких крупных производителей как Шатура, Brilliant AG, Light Star, EgloSarev, Tac, Экомебель, Pantex.\r\n	Здесь представлен огромный ассортимент мебели для дома и кухни, текстиля, посуды, осветительных приборов и аксессуаров на любой вкус покупателя.\r\n	Доступные цены, еженедельное пополнение коллекций, отличный сервис и постоянные распродажи сделают покупку приятной и выгодной!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5075', ' 													 - 											', '10,00%', '0.00', '0.00', 57, NULL, '2013-12-04 16:37:00'),
(5105, 'Game of Thrones Ascent', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/game_of_thrones_ascent_5105.5.htm', 'Онлайн-игры', 1, 'Game of Thrones Ascent &ndash; браузерная онлайн-игра, основанная на популярной серии книг Игра Престолов. Игра выполнена в фентезийном стиле и предлагает игроку пройти нелегкий путь от нищего дворянина к славе и богатству.\r\n	Прекрасная графика, множество локаций и вариантов прохождения, невероятные мистические истории и интриги, войны за расширение территорий, налаживание торговых отношений с другими игроками, борьба за несметные сокровища и славу &ndash; все это Game of Thrones Ascent!\r\n	\r\n	Официальный сайт: http://www.disruptorbeam.com/games/game-of-thrones', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5105', ' 													12,14											', '-', '2 588.57', '2 492.69', 1, NULL, '2013-12-04 16:37:00'),
(5115, 'Spartan Wars: Elite Edition', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/spartan_wars_elite_edition_5115.5.htm', 'Онлайн-игры', 1, 'Мобильная игра-приложение Spartan Wars, выполненная в стратегическом жанре &ndash; настоящая находка для тех, кто любит данное направление и готов приложить все усилия на развитие и строительство своей территории, прокачивание войска с последующими боями против тысячи других игроков.\r\n	Действие игры происходит в Мире Спарты, где игрок выступает против захвативших мир Спартанцев. По ходу игры игроку будут помогать мифические Боги и Герои, но для более продуктивного прохождения ему придется использовать свою смекалку и способности дипломатического мышления.\r\n	Уникальные возможности и умения, разнообразные миссии, загадки и квесты сделают процесс игры интересным и увлекательным!\r\n	Особенность Spartan Wars заключается в том, что она полностью совместима с iPhone, iPod touch и iPad.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5115', ' 													49,00											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:00'),
(5125, 'Delivery Club [Android]', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/delivery_club_android_5125.5.htm', 'Онлайн-игры, Продукты, напитки, табак, Онлайн-сервисы, Услуги, Досуг и развлечения', 1, 'Delivery Club &ndash; уникальное приложение, где собраны рестораны, кафе и службы доставки для удобного и быстрого заказа еды на дом в любое время суток.\r\n	В списке приложения представлено более 1800 наименований предприятий питания: итальянская и испанская, корейская и японская, грузинская и армянская, французская и немецкая кухни, бургеры, деликатесы и десерты &ndash; теперь в одном месте и в один клик.\r\n	Удобный способ заказа с возможностью просматривать фотографии блюд, рейтинг заведений, читать отзывы клиентов и точное время прибытия курьера. Все заказы сохраняются, а самым активным участникам Клуба начисляются бонусы и приятные скидки на будущие заказы.\r\n	Приложением пользуются уже более 500 000 человек!\r\n	Delivery Club &ndash; отличный способ заказать еду в любое время и место!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5125', ' 													27,00											', '-', '0.00', '0.00', 162, NULL, '2013-12-04 16:37:01'),
(5145, 'Pockie Pirates', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/pockie_pirates_5145.5.htm', 'Онлайн-игры', 1, 'Pockie Pirates – браузерная пиратская онлайн-игра в стиле пошаговой стратегии и RPG.\r\n	Для того чтобы начать увлекательное путешествие по мировой карте, игроку необходимо купить судно и нанять команду головорезов, обладающих своими уникальными навыками и умениями.\r\n	Вас ждут интересные задания, множество боевых арен и локаций, награды, сражения на суше и на море, а также интересные события, участие в которых помогут вам стать еще ближе к статусу Короля Пиратов.\r\n	Отправляйтесь в открытое море на поиски приключений и сокровищ!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5145', ' 													7,99											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:01'),
(5155, 'Tales of Solaris', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/tales_of_solaris_5155.5.htm', 'Онлайн-игры', 1, 'Tales of Solaris &ndash; это браузерная онлайн-игра в жанре RPG, которая также придется по вкусу всем любителям аниме.\r\n	Действие игры происходит на острове, которым управляет Орден Мориас, и игроку, как одному из членов Ордена, предстоит принять участие в войне с бандитами, стремящимися захватить остров.\r\n	Мир Tales of Solaris сосуществует с магией и развитыми технологиями, где игрока ждут интересные квесты, задания и незабываемые приключения!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5155', ' 													7,99											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:01'),
(5165, 'Grand Prix Racing', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/grand_prix_racing_5165.5.htm', 'Онлайн-игры', 1, 'Grand Prix Racing &ndash; браузерная онлайн-игра в жанре гоночного симулятора.\r\n	В начале игрок набирает команду гонщиков-новичков и развивает ее, участвуя в заездах, конкурсах и турнирах&nbsp; против команд-соперников, получая за это необходимые для апгрейда ресурсы и деньги. Далее вам предстоит построить собственную лабораторию, нанять техников и других необходимых сотрудников, заключить контракты со спонсорами и полезными организациями, которые помогут сделать ваш авто-салон известным и перспективным.\r\n	Grand Prix Racing придется по вкусу всем любителям стратегии, тактики, игрового менеджера и, конечно же, Формулы 1.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5165', ' 													6,91											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:01'),
