(5205, 'My Lucky Slots [iPhone & iPad]', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/my_lucky_slots_iphone_ipad_5205.5.htm', 'Онлайн-игры', 1, 'My Lucky Slots &ndash; игра-приложение в жанре онлайн-казино для всех пользователей iPhone и iPad.\r\n	Для игрока доступны 3000 монет и 8 игровых автоматов разной тематики, где он он может сделать любую ставку и испытать свою удачу!\r\n	Пробуйте различные выигрышные комбинации, получайте бонусные очки и наслаждайтесь процессом игры!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5205', ' 													32,00											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:01'),
(5215, 'Dark Age', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/dark_age_5215.5.htm', 'Онлайн-игры', 1, 'Dark Age &ndash; клиентская онлайн-игра о кровавой вражде Вампиров и Оборотней, где игроку предстоит выбрать одну из сторон и вступить в беспощадное противостояние между этими расами.\r\n	Разгадывайте загадки темного мира и раскрывайте интриги, сражайтесь с врагами и объединяйтесь с другими игроками, изучайте новые профессии и возможности персонажей, чтобы привести свой клан к абсолютному лидерству и доминированию.\r\n	Удобный геймплей, отличная графика, множество локаций и секретов ждут игрока!\r\n	Для того чтобы начать игру необходимо скачать клиент и запустить его.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5215', ' 													12,00											', '93,00', '3 291.63', '3 898.83', 1, NULL, '2013-12-04 16:37:01'),
(5265, 'Romwe', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/romwe_5265.5.htm', 'Одежда и обувь', 0, 'Интернет-магазин Romwe &ndash; это широкий выбор модной молодежной одежды и аксессуаров по выгодным ценам.\r\n	Ассортимент магазина постоянно пополняется новыми яркими и стильными коллекциями одежды для повседневной жизни, праздничных и клубных мероприятий, торжеств и других событий.\r\n	Удобный интерфейс позволяет без труда найти нужную вещь и быстро оформить заказ.\r\n	Доставка заказов осуществляется бесплатно в любую точку мира.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5265', ' 													 - 											', '10,00%', '4 026.66', '3 611.21', 5, NULL, '2013-12-04 16:37:01'),
(5275, 'Выбери приз-2 (RU)', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/vyiberi_priz_5275.5.htm', 'Конкурсы', 1, 'Выбери приз &ndash; отличная возможность для пользователей выиграть полезные призы на свой выбор.\r\n	В призовом фонде представлены планшеты, смартфоны, компьютеры от Apple, различные акции и купоны на покупки от таких магазинов как Пятерочка, Quelle, банковские предложения, а также купоны на изучение иностранных языков.\r\n	Для того чтобы принять участие в розыгрыше, необходимо заполнить заявку на сайте рекламодателя.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5275', ' 													12,95											', '-', '0.00', '0.00', 56, NULL, '2013-12-04 16:37:01'),
(5285, 'Intermarket', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/intermarket_5285.5.htm', 'Бытовая техника, Телефоны, Электроника и Фото, Компьютеры, Оборудование, Товары для авто- и мототехники, Товары для детей, Товары для офиса, Товары для дома и дачи, Товары для красоты и здоровья', 1, 'Intermarket является одним из крупнейших интернет-магазинов на территории Казахстана по продаже бытовой техники и электроники.\r\n	Здесь представлен широкий ассортимент техники для дома, кухни и автомобилей, телевизоров, компьютеров и мобильных устройств, а также оргтехники и приборов для красоты и здоровья.\r\n	Благодаря успешному и многолетнему сотрудничеству с крупнейшими фирмами-производителями, товары доступны по самым низким и привлекательным ценам.\r\n	Ассортимент продукции всегда постоянно обновляется и пополняется новыми моделями.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5285', ' 													128,00											', '-', '0.00', '13 230.45', 59, NULL, '2013-12-04 16:37:01'),
(5315, 'Galaxy Empire', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/galaxy_empire_5315.5.htm', 'Онлайн-игры', 1, 'Galaxy Empire &ndash; онлайн-игра, доступная как приложение для всех пользователей iPhone и iPad.\r\n	Действие игры происходит на неизвестной планете, где игроку предстоит создать собственную Империю Галактики путем строительства зданий, заводов и другой необходимой архитектуры, развития колоний и войск, а также исследования новейших технологий.\r\n	Завоевывайте космические и земные территории, участвуйте в ярких сражениях с другими игроками, вступайте в альянсы и выполняйте интересные задания и миссии.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5315', ' 													57,52											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:01'),
(5325, 'Cplaza', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/cplaza_5325.5.htm', 'Электроника и Фото, Телефоны, Компьютеры', 0, 'Cplaza &ndash; интернет-магазин, собравший в одном месте всю технику и аксессуары Apple, а также более 4000 наименований продукции от других мировых производителей: это планшетные компьютеры, ноутбуки, моноблоки, телефоны, зарядные устройства, акустические системы.\r\n	Опытные специалисты-консультанты всегда готовы предоставить клиенту исчерпывающую информацию о товаре и предложить наиболее выгодные варианты покупки.\r\n	Cplaza напрямую работает с поставщиками, что гарантирует быструю поставку и качество представленной продукции.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5325', ' 													 - 											', '2,60%', '0.00', '0.00', 31, NULL, '2013-12-04 16:37:01'),
(5365, 'Дельта кредит', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/delta_kredit_5365.5.htm', 'Финансы и Банки, Услуги', 1, 'С 1998 года банк Дельта Кредит успешно предоставляет своим клиентам услуги и выгодные программы по ипотечному кредиту на территории Российской Федерации.\r\n	Являясь одной из лидирующих компаний на рынке жилищного кредитования, Дельта Кредит имеет огромный опыт по оказанию высокопрофессиональных консультаций по любому вопросу кредитования, услугами которых уже воспользовались более 100 000 семей.\r\n	Дельта Кредит является первым специализированным ипотечным банком в России и всегда открыт для новых и постоянных клиентов и партнеров.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5365', ' 													460,00											', '-', '98 876.83', '136 746.59', 4, NULL, '2013-12-04 16:37:01'),
(5415, 'Mystery Manor [iPad only]', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/mystery_manor_ipad_only_5415.5.htm', 'Онлайн-игры', 1, '', '', ' 													42,00											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:01'),
(5575, 'Mojos', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/mojos_5575.5.htm', 'Одежда и обувь, Подарки, сувениры, цветы', 0, 'Mojos &ndash; интернет-магазин модных и стильных ювелирных изделий и аксессуаров для мужчин от поставщиков из Италии, США, Франции, Великобритании, Таиланда и Южной Кореи.\r\n	Благодаря прочному сотрудничеству с крупнейшими поставщиками, покупатели Mojos могут быть уверены в качестве товаров и оперативной доставке заказов в любую точку страны.\r\n	За 5 лет успешной работы Mojos успел зарекомендовать как надежный партнер с профессиональным и креативным подходом, первоклассным обслуживанием и доступной для всех ценовой политикой.\r\n	\r\n	Официальный сайт: http://www.mojos.ru/', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5575', ' 													 - 											', '8,47%', '0.00', '0.00', 142, NULL, '2013-12-04 16:37:01'),
(5595, 'Goodgame Empires', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/goodgame_empires_5595.5.htm', 'Онлайн-игры', 1, 'Goodgame Empires &ndash; это браузерная онлайн-игра, которая придется по вкусу всем любителям стратегического жанра.\r\n	Задача игрока &ndash; возведение своей уникальной империи путем строительства городов и расширения территорий.\r\n	Игрок может заниматься не только укреплением своей территории и обеспечением крова и еды для армии и мирных жителей, но и выходить на сражения с другими игроками или объединяться с ними в гильдии, развивать торговлю и проводить исследования новых технологий и ресурсов.\r\n	Приятная графика, отличный саундтрек, интересная сюжетная линия и разнообразные квесты сделают процесс игры увлекательным и заставят возвращаться к ней снова и снова!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5595', ' 													 - 											', '0,92', '14 924.20', '8 756.38', 1, NULL, '2013-12-04 16:37:01');
