(5605, 'Big Farm', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/big_farm_5605.5.htm', 'Онлайн-игры', 1, 'Big Farm &ndash; браузерная онлайн-игра, которая является симулятором фермерского хозяйства.\r\n	Игроку предстоит расширять собственную виртуальную ферму, выращивать овощи и фрукты и другие сельскохозяйственные культуры, разводить животных, заниматься строительством необходимых для этого фабрик и амбаров, развивать торговые и дружеские отношения с другими игроками, а также объединяться с ними в лиги для более успешного продвижения своего дела.\r\n	Вас ждут веселые приключения, увлекательные задания и призы, отличная графика и позитивные эмоции!\r\n	\r\n	Официальный сайт: http://bigfarm.goodgamestudios.com', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5605', ' 													23,32											', '-', '5 049.30', '4 442.11', 1, NULL, '2013-12-04 16:37:01'),
(5645, 'Big Fish Casino iPad', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/big_fish_casino_ipad_5645.5.htm', 'Онлайн-игры', 1, 'Big Fish Casino &ndash; онлайн-приложение в жанре казино, доступное для всех пользователей iPad.\r\n	Для вас доступно множество уникальных игровых автоматов с любимыми азартными играми: лотереи, блэк-джек, рулетки, карты, покер и многое другое, а также ежедневные турниры и мини-игры, которые дают возможность сорвать огромный куш и выиграть целое состояние.\r\n	Big Fish Casino предлагает более 300 000 бесплатных фишек, захватывающие соревнования с миллионами игроков в онлайн-режиме, большой выбор наград и подарков!\r\n	Игра является абсолютно бесплатной.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5645', ' 													95,87											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:01'),
