(5705, 'The Hobbit: Kingdoms of Middle-earth - iOS', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/the_hobbit_kingdoms_of_middle_earth_ios_5705.5.htm', 'Онлайн-игры', 1, 'The Hobbit: Kingdoms of Middle-earth &ndash; игра-приложение в&nbsp; жанре боевой стратегии, разработанная для пользователей системы iOS по мотивам одноименной книги.\r\n	Действие игры происходит в сказочном Средиземье, захваченном полчищами гоблинов и прочей нечисти. Для того чтобы уничтожить врагов, игроку предстоит заняться строительством и развитием своего города, созданием армии эльфов или гномов, а также по желанию объединяться в команды с другими игроками и принимать участие в турнирах за хорошие призы и получение новых навыков и способностей.\r\n	На протяжении игры вас ожидают увлекательные приключения, полные опасностей, сражений и встреч с книжными персонажами.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5705', ' 													19,86											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:01'),
(5765, 'BRAND-IN-TREND', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/brand_in_trend_5765.5.htm', 'Одежда и обувь', 0, 'Интернет-магазин BRAND-IN-TREND предлагает своим покупателям широкий ассортимент дизайнерской молодежной одежды, обуви и аксессуаров для женщин, мужчин и детей.\r\n	На прилавках магазина клиенты найдут модные коллекции от таких&nbsp; известных брендов как Marc Jacobs, Alexander McQueen, Vivienne Westwood, Michael Kors и многих других.\r\n	Весь ассортимент продукции постоянно пополняется новыми коллекциями оригинальных вещей превосходного качества и предусмотрен для абсолютного любого класса клиентов, что делает покупки приятными и доступными.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5765', ' 													 - 											', '14,00%', '2 684.44', '434 016.22', 5, NULL, '2013-12-04 16:37:01'),
(5775, 'СМП Банк: Ипотека', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/smp_bank_ipoteka_5775.5.htm', 'Финансы и Банки', 1, 'С 2001 года СМП Банк успешно предоставляет полный спектр финансовых услуг как для частных лиц, так и для корпоративных клиентов.\r\n	Основными принципами банка являются выгодны условия, а также высокое качество, оперативность предоставления услуг и индивидуальный подход к каждому клиенту.\r\n	Банк входит в список 50 самых крупнейших финансовых предприятий по размеру активов.\r\n	Деятельность СМП Банка осуществляется на основании лицензии на все виды банковских услуг, что позволяет клиентам обращаться сюда без малейшего для них риска.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5775', ' 													 - 											', '292,00', '0.00', '0.00', 2, NULL, '2013-12-04 16:37:01'),
(5855, 'Warside', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/warside_5855.5.htm', 'Онлайн-игры', 1, 'Warside &ndash; клиентский онлайн-шутер с классическим 2D геймплеем.\r\n	Действие игры происходит во время противостояния трех великих государств: Галактической Коммуны, Новой Империи и Корпорации Зетта,\r\n	где игроку предстоит создать персонажа, занять одну из сторон и сразу же отправится на поле боя против других игроков.\r\n	Развивайте своего воина, повышайте его уровень и характеристики, покупайте оружие и броню, участвуйте уникальных миссиях.\r\n	Удобный и понятный геймплей позволяет почувствовать всю атмосферу игры!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5855', ' 													 - 											', '30,00', '3 004.01', '2 844.23', 1, NULL, '2013-12-04 16:37:02'),
