(5895, 'Might & Magic: Duel of Champions-2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/might_magic_duel_of_champions_5895.5.htm', 'Онлайн-игры', 1, 'Might and Magic: Duel of Champions&nbsp; - это стратегическая онлайн-игра в жанре карточного менеджера, действие которой происходит во вселенной Might &amp; Magic.\r\n	Игрок выбирает сторону, на которой будет играть: Альянс Света, Инферно или Некрополис и создает свою непобедимую армию.\r\n	Каждый противник в Duel of Champions&nbsp; - реальный игрок со своей уникальной тактикой и коллекцией игральных карт.\r\n	Для успешного прохождения игры и увеличения карточной коллекции вам понадобится использовать свои стратегические навыки, а также различные тактические приемы.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5895', ' 													14,00											', '-', '2 460.74', '2 173.12', 1, NULL, '2013-12-04 16:37:02'),
(5915, 'Prover.me', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/prover_me_5915.5.htm', 'Инфопродукты, Онлайн-сервисы', 0, 'Уникальная программа Prover.me позволяет получить информацию об активности определенного круга лиц во всех известных социальных сетях.\r\n	Prover.me является неотъемлемой частью в построении успешного биснеса, помогает развеять сомнения в коллегах, партнерах и личной жизни.\r\n	Программа не требует каких-либо специальных действий в применении: клиент указывает список необходимых для проверки людей и ежедневно получает отчет об их действиях на свою электронную почту.\r\n	Для установки программы необходимо скачать ее на официальном сайте и установить на компьютер.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5915', ' 													 - 											', '385,00', '0.00', '0.00', 60, NULL, '2013-12-04 16:37:02'),
(5935, 'Правила войны. Ядерная стратегия-2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/pravila_voynyi_yadernaya_strategiya_5935.5.htm', 'Онлайн-игры', 1, 'Правила Войны. Ядерная стратегия &ndash; игра-приложение от компании Plarium в стратегическом жанре. Появившись сравнительно недавно, она получила огромный успех среди подобных приложений ВКонтакте.\r\n	Игра начинается с обучения, проводимым харизматичным генералом Лапидусом. После выполнения около 50 заданий, игрок получает не только награды, но и справку от генерала, которая очень пригодится при прохождении.\r\n	На протяжении всей игры игроку предстоит отстраивать свой форт, создавать армию, захватывать рудники, участвовать в войнах между кланами, а также воевать с главными злодеями &ndash; Гадами.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5935', ' 													 - 											', '14,00 - 47,00', '3 802.95', '3 802.95', 1, NULL, '2013-12-04 16:37:02'),
(5995, 'Rift Hunter', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/rift_hunter_5995.5.htm', 'Онлайн-игры', 1, 'Rift Hunter – бесплатное приложение для всех пользователей Android.\r\n	Континент Адалы захвачен страшными демонами, для уничтожения которых был создан специальный отряд Rift Hunter, состоящий из элитных и сильнейших воинов.\r\n	Игрока ждет увлекательный боевик с яростными аркадными PvE и PvP-сражениями, огромным разнообразием уровней и арен, бесконечными комбо, множеством интересных событий и персонажей, выполненных в аниме-стиле.\r\n	Двухмерная графика придется по вкусу всем любителям файтингов 90-х на консолях Dendi и SEGA.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=5995', ' 													23,97											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:02'),
(6005, 'Panzar - 2', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/panzar_6005.5.htm', 'Онлайн-игры', 0, 'Panzar: Forged by chaos &ndash; бесплатная клиентская онлайн-игра в фентезийном стиле, где игрокам придется сразиться в битвах на аренах.\r\n	В игре представлены четыре расы: люди, орки, гномы и эльфы, каждая из которых имеет по 2 класса: паладин и инквизитор, канонир и сапер, танк и берсерк и заклинателиц огня и льда от расы эльфов. Все герои продуманы до мельчайших деталей: одежда, оружие, движения.\r\n	Битвы проходят на огромных аренах: вы можете сражаться не только один на один, но и принять участие к командных боях, получая по результатам сражения опыт и полезные для развития персонажа предметы.\r\n	У каждой расы есть свои индивидуальные приемы и навыки ведения боя.\r\n	Потрясающая графика и красочные локации не оставят равнодушными любителей прекрасного!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6005', ' 													 - 											', '32,00', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:02'),
(6015, 'Фотострана: Мой питомец', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/fotostrana_moy_pitomets_6015.5.htm', 'Онлайн-игры', 1, 'Фотострана: Мой питомец &ndash; одна из самых динамично развивающихся онлайн-игр в социальных сетях Российской Федерации, которая славится отличным незамысловатым сюжетом, интересными заданиями и приятной графикой.\r\n	Пользователь выбирает себе питомца и начинает ухаживать за ним, выполнять квесты, участвовать в спортивных соревнованиях, гонках, выращивать растения и даже бороться со вселенским злом.\r\n	Простой и удобный геймплей позволяет окунуться в нарисованный виртуальный мир и получить массу удовольствия от игрового процесса.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6015', ' 													 - 											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:02'),
(6195, 'Star Wars Force Collection [Android]', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/star_wars_force_collection_android_6195.5.htm', 'Онлайн-игры', 1, 'Star Wars Force Collection &ndash; онлайн-игра в жанре карточной стратегии для всех пользователей Android, в основе которой лежит популярнейший фильм Star Wars.\r\n	Игроку предстоит создать свою команду, собрать уникальную коллекцию игральных карт с любимыми персонажами и отправиться на завоевание галактики.\r\n	Развивайте новые способности и характеристики карт, общайтесь с другими игроками, объединяйтесь в команды, побеждайте врагов, а также принимайте участие в интересных событиях и мероприятиях, которые будут проводиться между игроками на различных экзотических планетах.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6195', ' 													53,05											', '-', '4 090.57', '2 812.27', 1, NULL, '2013-12-04 16:37:02'),
(6205, 'Dragon Eternity HD [iPad]', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/dragon_eternity_hd_ipad_6205.5.htm', 'Онлайн-игры', 1, 'Dragon Eternity HD &ndash; онлайн-игра для iPad в стиле фэнтези, действие которой происходит в сказочном мире Адан, наполненном монстрами, людьми, магическими существами и загадками.\r\n	Игроку предстоит выбрать один из трех боевых классов и отправиться в захватывающее путешествие по опасному миру. Также вы получаете возможность призвать спутника-дракона и других существ для защиты и сражений с другими игроками, а также прохождения различных квестов и заданий.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6205', ' 													60,72											', '-', '2 428.78', '2 428.78', 1, NULL, '2013-12-04 16:37:02'),
(6225, 'iHotel [iOS 7 Only]', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/ihotel_ios_only_6225.5.htm', 'Онлайн-игры, Путешествия, туризм', 1, 'iHotel &ndash; бесплатное приложение, с помощью которого пользователи iOS 7 имеют возможность бронировать гостиницы, хостелы, мотели и другое жилье по всему миру в режиме онлайн.\r\n	Здесь представлено более 250 000 вариантов размещения от эконом-класса до шикарных апартаментов. Благодаря удобной системе поиска и всегда актуальным ценам, пользователь быстро и безопасно, а главное, без предоплаты, найдет подходящее место для размещения.\r\n	Путешествия с iHotel стали еще проще и доступнее!', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6225', ' 													31,96											', '-', '0.00', '0.00', 163, NULL, '2013-12-04 16:37:02'),
(6275, 'Street Crime', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/street_crime_6275.5.htm', 'Онлайн-игры', 1, 'Street Crime &ndash; браузерная онлайн-игра в криминальном жанре, действие которой происходит во времена кризиса с последующей жестокой войной и хаосом, из-за чего на улицах города нарушился порядок и контроль среди мафии.\r\n	Игрок выступает в роли бывшего заключенного, которому предстоит восстановить прежний порядок.\r\n	Все события и бои проходят в пошаговом режиме, а наличие интересных квестов и заданий сделают процесс игры увлекательным и затягивающим.\r\n	Игра придется по вкусу всем любителям гангстерских разборок и приключений в стиле GTA.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6275', ' 													12,14											', '-', '2 972.06', '2 972.06', 1, NULL, '2013-12-04 16:37:02'),
(6285, 'Star Wars Force Collection [iOS]', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/star_wars_force_collection_ios_6285.5.htm', 'Онлайн-игры', 1, 'Star Wars Force Collection &ndash; онлайн-игра в жанре карточной стратегии для всех пользователей iOS, в основе которой лежит популярнейший фильм Star Wars.\r\n	Игроку предстоит создать свою команду, собрать уникальную коллекцию игральных карт с любимыми персонажами и отправиться на завоевание галактики.\r\n	Развивайте новые способности и характеристики карт, общайтесь с другими игроками, объединяйтесь в команды, побеждайте врагов, а также принимайте участие в интересных событиях и мероприятиях, которые будут проводиться между игроками на различных экзотических планетах.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6285', ' 													39,31											', '-', '4 122.53', '3 898.83', 1, NULL, '2013-12-04 16:37:02'),
(6295, 'MoboGenie Market [Android]', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/mobogenie_market_android_6295.5.htm', 'Онлайн-игры', 1, 'MoboGenie Market &ndash; удобное и полезное приложение, доступное всем пользователям Android.\r\n	С помощью MoboGenie Market пользователь может скачивать различные приложения сразу на свой смартфон, планшет или другое устройство без наличия компьютера.\r\n	Здесь собраны самые лучшие игры, обои, рингтоны, информация об обновлениях Android и обзоры новинок, отзывы других пользователей, а также редкие и труднодоступные программы.\r\n	MoboGenie Market&nbsp; интегрирован с топовыми статьями в социальных сетях Facebook и Twitter, что делает применение приложения еще более расширенным и интересным.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6295', ' 													4,15											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:02'),
(6325, 'House Of Fun [iOS]', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/house_of_fun_ios_6325.5.htm', 'Онлайн-игры', 1, 'House Of Fun &ndash; бесплатное и захватывающее слот-приложение для всех пользователей iOS.\r\n	Здесь доступно огромное количество игровых автоматов, разнообразные слоты, бонусы и джекпоты, возможность играть с тысячами игроков по всему миру, повышать свой уровень и зарабатывать очки.\r\n	Приглашайте своих друзей, получайте эксклюзивные предложения, участвуйте в турнирах и других увлекательных игровых событиях.\r\n	Приложение постоянно обновляется и наполняется новыми возможностями и дополнениями, которые обязательно понравятся пользователям.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6325', ' 													47,94											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:02'),
(6365, 'Shopbop', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/shopbop_6365.5.htm', 'Одежда и обувь', 0, 'Бутик Shopbop - интернет-магазин, который специализируется на продаже подлинных дизайнерских коллекций одежды, обуви и аксессуаров.\r\n	На прилавках Shopbop представлен огромный ассортимент модных товаров от известных мировых брендов и производителей, а также новых талантливых дизайнеров, готовых представить уникальные идеи и тенденции для тех, кто постоянно следит за новинками в мире моды. Специальный раздел Эксклюзив наполнен лимитированными моделями, доступными только здесь. Shopbop - один из лидирующих магазинов в мире и часто упоминается в самых модных глянцевых журналах.\r\n	Shopbop является частью группы компаний Amazon, что гарантирует покупателям качество продукции и отличный сервис.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6365', ' 													 - 											', '3,00% - 6,00%', '0.00', '0.00', 5, NULL, '2013-12-04 16:37:02'),
(6375, 'Banda [Android]', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/banda_android_6375.5.htm', 'Онлайн-игры', 1, 'Banda &ndash; игра-приложение, доступное для всех пользователей Android.\r\n	Основной целью игры является создание своей банды, с помощью которой необходимо обезвредить главного врага &ndash; Доктора Власть, намеревающего&nbsp; уничтожить все человечество.\r\n	Игрок может набрать к себе в команду таких героев как Маги, Вампиры, Охотники, Асасины и других персонажей с уникальными способностями. На протяжении игры вы будете преследовать врагов, путешествуя по разным континентам, участвовать в сражениях и интересных игровых событиях, получать опыт и развивать сверхспособности своих персонажей.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6375', ' 													24,29											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:02'),
(6495, 'Jungle Heat [iOS]', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/jungle_heat_ios_6495.5.htm', 'Онлайн-игры', 1, 'Jungle Heat&nbsp; - бесплатная игра-приложение для всех пользователей iOS.\r\n	В основе игры лежит развитие своей военной базы, которая будет располагаться в жарких и опасных тропиках.\r\n	Игроку предстоит добывать различные ресурсы, строить здания, нанимать солдат, продумывать уникальную стратегию нападения на врагов и атаковать их, а также участвовать в увлекательных квестах и поисках сокровищ.\r\n	Яркая графика, легкость в управлении и незамысловатый сюжет сделают процесс игры интересным и веселым.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6495', ' 													38,00											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:02'),
(6505, 'Галактика знакомств. Galaxy Chat&Play [Android]', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/galaktika_znakomstv_galaxy_chat_play_android_6505.5.htm', 'Онлайн-игры', 1, 'Галактика знакомств. Galaxy Chat&amp;Play &ndash; бесплатный сервис для знакомств, отдыха и отличного времяпрепровождения.\r\n	Пользователь создает своего уникального героя и отправляется в виртуальный мир для поиска новых друзей и выполнения различных заданий.\r\n	Играйте в онлайн-игры, знакомьтесь с новыми людьми, делитесь с ними фотографиями, своими успехами и достижениями, участвуйте в конкурсах, дарите подарки и зарабатывайте рейтинги.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6505', ' 													24,00											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:02'),
(6525, 'Игростройка', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/igrostroyka_6525.5.htm', 'Онлайн-игры', 1, 'Игростройка &ndash; это удобный портал, который содержит огромное количество браузерных онлайн-игр. Здесь все любители азартных игр обязательно найдут себе что-нибудь на свой вкус: шахматы, шашки, нарды, морской бой и многое другое.\r\n	После простой регистрации пользователь получает доступ к перечню игр, которые помогут скоротать досуг.\r\n	Участвуйте в ежедневных турнирах и кубках, побеждайте реальных соперников, вербуйте в свою команду друзей и других игроков, покупайте в онлайн-магазине необходимые предметы, все это абсолютно бесплатно возможно на портале Игростройка.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6525', ' 													0,38											', '-', '0.00', '0.00', 1, NULL, '2013-12-04 16:37:02'),
(6575, 'Russian Brides', 'https://cityads.ru/ru/webmaster/offeryi/spisok_offerov/russian_brides_6575.5.htm', 'Досуг и развлечения', 1, 'Russian Brides &ndash; сайт знакомств, направленный на поиск и создание отношений с русскими девушками и женщинами.\r\n	Russian Brides содержит огромную базу данных с анкетами очаровательных русских женщин для общения, романтических отношений или создания семьи. Возможность общаться в чате, обмениваться фотографиями, а также удобная поисковая система по интересам понравится всем пользователям этого сервиса.\r\n	Для того чтобы получить доступ к анкетам, необходимо пройти быструю и бесплатную регистрацию на официальном сайте.', '/ru/webmaster/offeryi/promo_29054.0.htm?offer_id=6575', ' 													131,03											', '-', '0.00', '0.00', 32, NULL, '2013-12-04 16:37:03');
